INSERT INTO `email_templates` (`id`, `name`, `subject`, `html_content`, `text_content`, `variables`, `category`, `banner_image`, `is_active`, `created_by`, `created_at`, `updated_at`) VALUES
(2, 'B Testing LifeScience and Research', 'Tools to Support Your Scientific Work', '', 'Hi {{first_name}},\r\n\r\nHope your week’s going smoothly. I’m Walid from MaxMed—we’ve been working with research teams in the region to help them source reliable tools for their studies.\r\n\r\nRecently, we’ve supported projects involving:\r\n\r\nRecombinant antibodies and immune checkpoint tools\r\n\r\nValidated cell lines\r\n\r\nLigands, inhibitors, and core reagents\r\n\r\nIf you’re working on something where we could lend a hand—whether sourcing a reagent or brainstorming a solution—I\'d be happy to connect.\r\n\r\nAll the best, \r\nWalid \r\nwbabi@maxmedme.com \r\nwww.maxmedme.com\r\n+971 55 4602500', NULL, 'promotional', 'email-banners/A3f6ZSoTLhjqc2aHsOQYSRYFri0hT2GOcAbwhhlT.jpg', 1, 7, '2025-06-29 19:05:25', '2025-06-29 19:25:38'),
(3, 'A Testing LifeScience and Research', 'Supporting Your Scientific Work', '', 'Hi {{first_name}},\r\n\r\nHope your week’s going well. I’m Walid from MaxMed—we’ve been working with researchers in the region to support their evolving needs in the lab.\r\n\r\nRecently, we’ve helped with:\r\n\r\nRecombinant antibodies and immune checkpoint tools\r\n\r\nValidated cell lines\r\n\r\nLigands, inhibitors, and essential reagents\r\n\r\nIf you’re working on something where we might assist—whether it’s sourcing a specific item or sharing insights—I’d be happy to connect.\r\n\r\nAll the best,\r\nWalid\r\nwbabi@maxmedme.com\r\nwww.maxmedme.com\r\n+971 55 4602500', NULL, 'promotional', 'email-banners/d8VzQ41nN0Fx8dSraG33VCjy5gFEQalvl6tn5kRN.jpg', 1, 7, '2025-06-29 19:10:22', '2025-06-29 19:33:06');
