(83, 'MW-0043', 'TC1000-S Thermal Cycler Standard', 'tc1000-s-thermal-cycler-standard-mw-0043-maxware-dubai-uae', 'High performance Peltier and independent heating segments improving temperature control\r\nAuxiliary heating mechanism diminishes the \"edge effect\" and enhance the temperature uniformity\r\nWide touchdown PCR temperature range (-9.9°C~+9.9°C) and Long PCR time range (-9min 59s~+9min 59s)\r\nGradient temperature setting optimizes temperature easily in the single run\r\nColor touch screen with user friendly interface helps to edit programs easily\r\nWide options of consumables: common PCR tubes, 8-well PCR strips and 96-well PCR plates can be used\r\nFile customization, multi-file storage \r\nPower failure protection function, automatic program recovery\r\nHot lid auto-off function: If module temperature is lower than 30 °C, the hot lid function will automatically turn off\r\nElegant design, excellent precision and accurate, reproducible results and precise PCR optimization\r\nState of the art electronics, precision peltier device and flexible user interface.\r\nThe TC1000G is an essential laboratory instrument for molecular biology with applications such as sequencing, gene cloning, gene expression,mutagensis, and it is also used in areas such as drug discovery, agriculture, food industry, etc.\r\n\r\nPRODUCT PARAMETERS\r\nCat.No.\r\n5064101300\r\nSample Capacity\r\n96×0.2mL PCR tube | 12×0.2mL PCR-8 strips | 0.2mL 96 PCR Microplate\r\nHeating Temperature Range\r\n4-105℃\r\nLid Temperature Range\r\n30-110℃\r\nTemperature Display Accuracy\r\n±0.1℃\r\nTemperature Control Accuracy\r\n±0.3℃\r\nTemperature uniformity\r\n<0.3℃\r\nMax. Heating/Cooling Rate\r\n5℃/Sec\r\nGradient Temperature Setting Range\r\n-\r\nGradient Range\r\n-\r\nAdapter block material\r\nAluminum\r\nDisplay\r\n7\" LCD 800x480\r\nInput\r\nTouch panel\r\nUser defined file system\r\nMax.30 segments 99 cycles, and storage for over 200 files.\r\nPower off protection\r\nYes\r\nVoltage,Frequency\r\n100-120V/200-240V,50/60Hz\r\nDimension[WxDxH]\r\n280x370x250mm\r\nWeight\r\n11kg', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/bGMYqzaabIV5ttPrz0qJ5dXGLSODC3dKW45WXO1G.png', 63, 1, NULL, 0, NULL, NULL, 1, '2025-04-11 19:21:45', '2025-06-15 22:06:34'),
(84, 'MW-0044', 'TC1000-G-Pro Thermal Cycler Gradient', 'tc1000-g-pro-thermal-cycler-gradient-mw-0044-maxware-dubai-uae', 'Elegant design, excellent precision and accurate, reproducible results and precise PCR optimization；\r\nNew UI user interface，easy to use graphical menu，color touch screen with user friendly interface helps to edit programs easily；\r\nHigh performance with advanced thermal gradient technology，high performance Peltier and independent heating segments improving temperature control；\r\nAuxiliary heating mechanism diminishes the \"edge effect\" and enhance the temperature uniformity，gradient temperature setting optimizes temperature easily in the single run；\r\nReal-time display of program progress and time remaining，set up user security accounts and passwords depending on customer needs；\r\nOne-click fast incubation function for denaturation、Enzyme digestion/enzyme linkage、required for ELISA etc.；\r\nPower failure protection function, automatic program recovery，ensure safe operation of the entire amplification process；\r\nBuilt-in WIFI module，connecting via LAN with a PC host computer，simultaneous control of multiple PCR instruments with one computer；\r\nHot lid temperature and hot lid operating mode can be set，meeting different experimental needs，if module temperature is lower than 30 °C, the hot lid function will automatically turn off；\r\nUSB interface, support for saving/retrieving PCR data on U disk, support for updating software on U disk and LAN, customisable programs，file customization, multi-file storage；\r\nWide touchdown PCR temperature range (-9.9°C~+9.9°C) and Long PCR time range (-9min 59s~+9min 59s)；\r\nWide options of consumables: common PCR tubes, 8-well PCR strips and 96-well PCR plates can be used；\r\n\r\nPRODUCT PARAMETERS\r\nCat.No.\r\n4044102100\r\nSample Capacity\r\n96×0.2mL PCR tube | 12×0.2mL PCR-8 strips | 0.2mL 96 PCR Microplate\r\nHeating Temperature Range\r\n0-105℃\r\nLid Temperature Range\r\n30-115℃\r\nTemperature Disp