(118, 'MT-0003', 'Pregnancy (hCG) Rapid Test （WB/S/P）', 'pregnancy-hcg-rapid-test-wbsp-mt-0003-maxtest-dubai-uae', 'The hCG Pregnancy Rapid Test (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of human chorionic gonadotropin in serum, plasma or whole blood to aid in the early detection of pregnancy.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/aASQfrvbj4Smf7qpNPZ1qa2TIhWEoj6vwzanYUnU.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:09:34', '2025-06-15 22:06:35'),
(120, 'MT-0004', 'Ovulation (LH) Rapid Test', 'ovulation-lh-rapid-test-mt-0004-maxtest-dubai-uae', 'The LH Ovulation Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of luteinizing hormone (LH) in urine to aid in the detection of ovulation.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/iwrJCdiUAsHrWPiJxYYbvIXjXwups6lVtjDM0GHq.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:10:57', '2025-06-15 22:06:35'),
(123, 'MT-0005', 'Follicle-Stimulating Hormone (FSH) Rapid Test', 'follicle-stimulating-hormone-fsh-rapid-test-mt-0005-maxtest-dubai-uae', 'The FSH Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of follicle stimulating hormone (FSH) in urine to aid in the detection of menopause.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/lxkkJuLRtyJdDSKrE8nXkhRYtyEdWTkVg6BT7eHl.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:12:14', '2025-06-15 22:06:35'),
(125, 'MT-0006', 'Fetal Fibronectin (fFN) Rapid Test', 'fetal-fibronectin-ffn-rapid-test-mt-0006-maxtest-dubai-uae', 'The fetal fibronectin (fFN) rapid test is a visually interpreted, qualitative immunochromatographic test device for detection of fFN in vaginal secretions during pregnancy, which is a special protein that literally holds your baby in place in the womb. The test is intended for professional use to help diagnose if the preterm delivery is likely to occur in pregnant women. The test may be run on patients between 24 and 34 weeks gestation.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/NaYl6asTnCjRbcAsGWgdrU7JcbduEeUTxa781OfP.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:13:07', '2025-06-15 22:06:35'),
(127, 'MT-0007', 'CMV IgG/IgM Rapid Test (S/P)', 'cmv-iggigm-rapid-test-sp-mt-0007-maxtest-dubai-uae', 'The CMV IgG/IgM Rapid Test is for the qualitative detection of IgG and IgM antibodies to CMV in specimen to aid in the diagnosis of Cytomegalovirus infection.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/aY0U7lAOaHdrY1JG3AjkjR9cbAm6RZXiCl8P0i3P.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:13:44', '2025-06-15 22:06:35'),
(128, 'MT-0008', 'CMV IgG/IgM Rapid Test (WB/S/P)', 'cmv-iggigm-rapid-test-wbsp-mt-0008-maxtest-dubai-uae', 'The CMV IgG/IgM Rapid Test is for the qualitative detection of IgG and IgM antibodies to CMV in specimen to aid in the diagnosis of Cytomegalovirus infection.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eurCfOgX5h6e2ivIceRBWjfthn2Tav7E59KVbcZ8.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:14:07', '2025-06-15 22:06:35'),
(131, 'MT-0009', 'HSV 1/2 IgG/IgM Rapid Test （WB/S/P）', 'hsv-12-iggigm-rapid-test-wbsp-mt-0009-maxtest-dubai-uae', 'The HSV 1/2 IgG/IgM Rapid Test is for the qualitative detection of IgG and IgM antibodies to HSV 1/2 (Herpes simplex virus 1 and 2) in specimens aid in the diagnosis of HSV 1/2 infection.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/VHBDjlzydkMLrdXlpIxU30zhBrMb24ePph6LeTPv.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:15:04', '2025-06-15 22:06:35'),
