(133, 'MT-0011', 'Toxo IgG/IgM Rapid Test （WB/S/P）', 'toxo-iggigm-rapid-test-wbsp-mt-0011-maxtest-dubai-uae', 'The Toxo IgG/IgM Rapid Test Cassette is a lateral flow chromatographic immunoassay for the simultaneous detection and differentiation of IgM anti-Toxoplasma Gondii (T.gondii) and IgG anti-T.gondii in human specimens. This kit is intended to be used as a screening test and as an aid in the diagnosis of infection with T.gondii. Any reactive specimen with the Toxo IgG/IgM Rapid Test Cassette must be confirmed with alternative testing method(s) and clinical findings.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/3Ojii0aelrH4D8V0UiT55FJtgozuchg184QyzdUZ.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:15:44', '2025-06-15 22:06:35'),
(134, 'MT-0012', 'Toxo IgG/IgM Rapid Test （S / P）', 'toxo-iggigm-rapid-test-s-p-mt-0012-maxtest-dubai-uae', 'The Toxo IgG/IgM Rapid Test Cassette is a lateral flow chromatographic immunoassay for the simultaneous detection and differentiation of IgM anti-Toxoplasma Gondii (T.gondii) and IgG anti-T.gondii in human specimens. This kit is intended to be used as a screening test and as an aid in the diagnosis of infection with T.gondii. Any reactive specimen with the Toxo IgG/IgM Rapid Test Cassette must be confirmed with alternative testing method(s) and clinical findings.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/wVzIPGfm39SVfO3h6ZVYquKxQg1uj4qC3pw7QKMp.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:16:08', '2025-06-15 22:06:35'),
(136, 'MT-0013', 'ToRCH IgG/IgM Rapid Test （S/P）', 'torch-iggigm-rapid-test-sp-mt-0013-maxtest-dubai-uae', 'ToRCH IgG Combo Rapid Test Cassette is a rapid chromatographic immunoassay for the qualitative detection of IgG antibodies to Toxoplasma gondii (Toxo), Rubella virus (Rubella), Cytomegalovirus (CMV), and Herpes simplex virus 1/2 (HSV 1/2) in specimens to aid in the diagnosis of ToRCH. ToRCH IgM Combo Rapid Test Cassette is a rapid chromatographic immunoassay for the qualitative detection of IgM antibodies to Toxoplasma gondii (Toxo), Rubella virus (Rubella), Cytomegalovirus (CMV), and Herpes simplex virus 1/2 (HSV 1/2) in specimens to aid in the diagnosis of ToRCH.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/MDH60FYYw9GPxGqYWjuIYHXagcrTYOYxH5S61dZ8.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:16:48', '2025-06-15 22:06:35'),
(140, 'MT-0014', 'Gonorrhea Rapid Test', 'gonorrhea-rapid-test-mt-0014-maxtest-dubai-uae', 'The Gonorrhea Rapid Test Cassette (Swab) is a rapid chromatographic immunoassay for the qualitative detection of Neisseria gonorrhoeae in female cervical swab and male urethral swab specimens to aid in the diagnosis of Gonorrhea infection.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/51Mv2CHXenWEixQEgFWwG1pM0pivTKNn0rbS5RAX.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:18:04', '2025-06-15 22:06:35'),
