(143, 'MT-0016', 'Strep B Rapid Test', 'strep-b-rapid-test-mt-0016-maxtest-dubai-uae', 'The Strep B Rapid Test is for the qualitative, presumptive detection of Group B Streptococcus (GBS) antigens in specimens taken from vaginal or rectal swabs of pregnant women, or general swabs from newborn. This kit is intended for use as an aid in the diagnosis of Strep B infection.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/rZ1zTliF2mu9hqXtgv7aSkt9HTaUb9i7tzz79HfU.png', 81, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:19:04', '2025-06-15 22:06:35'),
