(146, 'MT-0018', 'Carcinoembryonic Antigen (CEA) Rapid Test', 'carcinoembryonic-antigen-cea-rapid-test-mt-0018-maxtest-dubai-uae', 'The CEA Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of CEA in whole blood, serum or plasma to aid in monitoring of cancer patients. CEA testing plays an important role in the monitoring of cancer patients.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/OaLGspS54NFNpwMWUfQe0vhxbGGMYNuYp57OB1tX.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:23:03', '2025-06-15 22:06:35'),
(152, 'MT-0019', 'Fecal Occult Blood (FOB) Rapid Test (25 ng/mL)', 'fecal-occult-blood-fob-rapid-test-25-ngml-mt-0019-maxtest-dubai-uae', 'The FOB Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Human Occult Blood in feces.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ywLGTsOmihIF79dgN7ml8BBRfpdkVFwRVI6T45kj.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:25:16', '2025-06-15 22:06:35'),
(153, 'MT-0020', 'Fecal Occult Blood (FOB) Rapid Test (40 ng/mL)', 'fecal-occult-blood-fob-rapid-test-40-ngml-mt-0020-maxtest-dubai-uae', 'The FOB Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Human Occult Blood in feces.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/6QRKV5fpXwV9O72TWsrZWxP9dw3iOh7e2KKuevEQ.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:25:35', '2025-06-15 22:06:35'),
(154, 'MT-0021', 'Fecal Occult Blood (FOB) Rapid Test (50 ng/mL)', 'fecal-occult-blood-fob-rapid-test-50-ngml-mt-0021-maxtest-dubai-uae', 'The FOB Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Human Occult Blood in feces.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/5PCFKDn4iw3V1DQG0Tu6nVQJFcPHKfAhJX9ZHuET.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:25:56', '2025-06-15 22:06:35'),
(164, 'MT-0022', 'Transferrin and FOB Combo Rapid Test', 'transferrin-and-fob-combo-rapid-test-mt-0022-maxtest-dubai-uae', 'The Transferrin/FOB Combo Rapid Test is a rapid chromatographic immunoassay (non-invasive assay) for the qualitative detection of human hemoglobin and transferrin in human feces specimens, which might be useful for the diagnosis of bleeding gastrointestinal disorders.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/r6C5kfGkvRi9LOIK6zTsdFuR5xrrWvYDpy3TPmkY.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:30:33', '2025-06-15 22:06:35'),
(165, 'MT-0023', 'Hb+Hb-Hp Combo Rapid Test', 'hbhb-hp-combo-rapid-test-mt-0023-maxtest-dubai-uae', 'The Hb+Hb-Hp Combo Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of hemoglobin and/or haptoglobin-hemoglobin complex in feces.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/1XjRBdoPoDZwqTJMFimpmxJproABTCT3Zhm7em9P.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:31:03', '2025-06-15 22:06:35'),
(166, 'MT-0024', 'Transferrin/FOB and Hb-Hp Combo Rapid Test', 'transferrinfob-and-hb-hp-combo-rapid-test-mt-0024-maxtest-dubai-uae', 'The Transferrin/FOB and Hb-Hp Combo Rapid Test is a rapid chromatographic immunoassay (non-invasive assay) for the qualitative detection of human hemoglobin, transferrin and Hemoglobin(Hb)-Haptoglobin(Hp) complex in human feces specimens, which might be useful for the diagnosis of bleeding gastrointestinal disorders.\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.01, NULL, NULL, 'https://maxmedme.com/storage/products/AkgwRwaP1PkYtwOmlOx7PTp0JHq9ieSRYazhF6dA.png', 84, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 05:31:29', '2025-06-15 22:06:35'),
(175, 'MT-0025', 'H-FABP and cTnI Combo Rapid Test', 'h-fabp-and-ctni-combo-rapid-test-mt-0025-maxtest-dubai-uae', 'The H-FABP/Cardiac Troponin I Combo Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of human H-FABP and cardiac Troponin I (cTnI) in whole blood, serum or plasma as an aid in the diagnosis of myocardial infarction (MI).\r\nProduct Features\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/atcgo0KocmAUSZg44RNGsnAUiswVkNECYrK0OqUG.png', 85, 2, NULL, 0, NULL, NULL, 1, '2025-04-17 06:14:01', '2025-06-15 22:06:35');
