(185, 'MW-0074', 'Hydroxide Anion Exchange Chromatography Columns', 'hydroxide-anion-exchange-chromatography-columns-mw-0074-maxware-dubai-uae', 'HydroxideAnion Exchange Chromatography Column The unique surface bonding technology, combined with adjustable modificationmethods, enables this series of chromatography columns to exhibit excellent selectivityand separation erformance,suitable forthe simultaneous analysis ofvarious anions.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/3sd8EAxWpmFGkZnXGYE5PPdMqMTy7liZHLNyBN5g.png', 89, 1, NULL, 0, NULL, NULL, 1, '2025-04-17 18:50:38', '2025-06-15 22:06:34'),
(186, 'MW-0075', 'Carbonate Anion Exchange Chromatography Columns', 'carbonate-anion-exchange-chromatography-columns-mw-0075-maxware-dubai-uae', 'The column utilizes selected quaternization reagents, combined with porous polystyrene/divinylbenzene microspheres and unique surface modification techniques, enabling thisseries ofchromatographycolumnsto possess excellentseparation performance forvariousanionsin the carbonate system.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/oKRuTWb0ryEW2dIt1kGv03eVjqNOkDA9IOZmXKtv.png', 89, 1, NULL, 0, NULL, NULL, 1, '2025-04-17 18:54:01', '2025-06-15 22:06:34'),
(187, 'MW-0076', 'Methane Sulfonic Acid Cation Exchange Chromatography Columns', 'methane-sulfonic-acid-cation-exchange-chromatography-columns-mw-0076-maxware-dubai-uae', 'Cation Exchange Chromatography Column The combination of porous PS/DVB microspheres with unique grafting techniques resultsin a high-capacity carboxylic acid functionalized chromatography packing material, enablingthis column to exhibit excellent separation performance for six common cations, while alsoproviding excellent peakshape for the separation ofother methylamines.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/APV7ubMLW6We1xvb6e4mFVQcpelTBK7AggbxSwOT.png', 89, 1, NULL, 0, NULL, NULL, 1, '2025-04-17 18:55:17', '2025-06-15 22:06:34'),
(188, 'MM-0046', 'HPLC Column Nova Atom Liquid Chromatography', 'hplc-column-nova-atom-liquid-chromatography-mw-0077-maxware-dubai-uae', 'The conventional liquid chromatography columns independentlydeveloped by NovaChrom utilize uniform silica gel microspheres, combined withadvanced and stable bonding phase modification techniques, enabling the separationof analytes with different hydrophobicities. These columns have a wide range ofapplications and offer high cost-effectiveness.Thehybridseries adopt organic-inorganichybrid silica gel microspheres, combined with novel bonding technologies, suitable forapplications requiring awide pH range and various mobile phase systems.\r\n\r\nKey words: C18, PC18, AQC18, SC18, C8, Ph, PFP, NH2, CN, Diol, Sil', 450.00, 1665.00, NULL, NULL, 'https://maxmedme.com/storage/products/JeokwMNVXqTmJKJYFCePrLAK90dGM5KqmKF0hIMy.png', 90, NULL, NULL, 1, '[\"Nova Atom C18 – 5µm, 4.6×250mm\", \"Nova Atom Pc18 – 5µm, 4.6×250 mm\", \"Nova Atom Sc18 – 5µm, 4.6×250 mm\", \"Nova Atom C8 – 5µm, 4.6×250 mm\", \"Nova Atom Ph – 5µm, 4.6×250 mm\", \"Nova Atom NH2 – 5µm, 4.6×250 mm\", \"Nova Atom CN – 5µm, 4.6×250 mm\", \"Nova Atom Diol – 5µm, 4.6×250 mm\"]', NULL, 1, '2025-04-17 19:24:24', '2025-06-28 02:05:37'),
(189, 'MW-0078', 'HPLC Column Nova Element Liquid Chromatography', 'hplc-column-nova-element-liquid-chromatography-mw-0078-maxware-dubai-uae', 'The Nova Element series is a hybrid particle chromatographic column developed by NovaChrom. It exhibits excellent pH tolerance and stability, achieved through triple bonding technology followed by endcapping, which reduces silanol activity and results in superior peak shapes for basic compounds. With a broad pH range for mobile phases and extended column lifespan, it offers enhanced selectivity for method development. This series is suitable for common liquid chromatography analyses across various industries, including food, traditional Chinese medicine, chemical pharmaceuticals, environmental testing, water quality, and healthcare.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/6GQ1CxXYXgN7uEiWBiq0CqmgbhwB9FOrMAi1v8go.png', 90, 1, NULL, 0, NULL, NULL, 1, '2025-04-17 19:28:41', '2025-06-15 22:06:34'),
(190, 'MW-0079', 'Liquid Chromatography Columns for Special Industries (HPLC)', 'liquid-chromatography-columns-for-special-industries-hplc-mw-0079-maxware-dubai-uae', 'In order to better separate substances with different characteristics, NovaChrom conducts research on the development and production technology of chromatographic fillers, designing specialized chromatographic columns specifically tailored for the analysis of various types of substances.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/atxP7G9MZBaVXKNNEOfEs4rcfhQxhI6Ruuf2vaxg.png', 90, 1, NULL, 0, NULL, NULL, 1, '2025-04-17 19:29:48', '2025-06-15 22:06:34'),
(192, 'MT-0026', 'Celiac Rapid Test Cassette', 'celiac-rapid-test-cassette-mt-0026-maxtest-dubai-uae', 'The Celiac Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of IgA antibodies to human tTG in human whole blood, serum, or plasma as an aid in the diagnosis of celiac disease.\r\n\r\nProduct Features\r\n\r\nHigh Accuracy \r\n\r\nConvenient Operation\r\n\r\nFast Results in 10 Minutes\r\n\r\nClear Visual Interpretation', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/iA9UbT5Rrt1x8QZUy7eQWHi1KgeW0Z5oyRy2cmj8.png', 86, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 19:09:57', '2025-06-15 22:06:35'),
(200, 'MT-0027', 'Thyroid Stimulating Hormone (TSH) Rapid Test', 'thyroid-stimulating-hormone-tsh-rapid-test-mt-0027-maxtest-dubai-uae', 'The TSH Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Thyroid Stimulating Hormone (TSH) in whole blood, serum, or plasma to aid in the screening the adult population for primary hypothyroidism by medical professionals. It is not indicated for use in screening neonates for hypothyroidism.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/nrzvN0jEdXzKTVq2E4gvkBaFiO2vPnm3ycmeXCyA.png', 86, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 19:16:27', '2025-06-15 22:06:35'),
