(226, 'MT-0039', 'Rhinovirus Rapid Test (Nasopharyngeal Swab)', 'rhinovirus-rapid-test-nasopharyngeal-swab-mt-0039-maxtest-dubai-uae', 'The Rhinovirus Rapid Test (Nasopharyngeal Swab) is a rapid chromatographic immunoassay for the qualitative detection of rhinovirus antigens in human nasopharyngeal swab as an aid in the diagnosis of Rhinovirus infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/X2Iwne5TZj1ckrvdibB4Cair1iL39EmEIPsCT1kb.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:15:14', '2025-06-15 22:06:35'),
(227, 'MT-0040', 'Adenovirus/RSV/HMPV/SARS-CoV-2/Influenza A+B Combo Rapid Test (Nasopharyngeal Swab)', 'adenovirusrsvhmpvsars-cov-2influenza-ab-combo-rapid-test-nasopharyngeal-swab-mt-0040-maxtest-dubai-u', 'The Adenovirus/RSV/HMPV/SARS-CoV-2/Influenza A+B Combo Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Adenovirus antigens, Respiratory Syncytial Virus (RSV) antigens, human metapneumovirus (HMPV) antigens,SARS-CoV-2 nucleocapsid protein, Influenza A and B antigens in human nasopharyngeal swab specimens. It is intended to aid in the rapid differential diagnosis of Adenovirus, Respiratory Syncytial Virus viral, HMPV, SARS-CoV-2, Influenza A and B infections.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ON8faEgC5LOUtsVIhIvUSgPos5a8D4cRTFpAa5aY.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:16:47', '2025-06-15 22:06:35'),
(228, 'MT-0041', 'Adenovirus/RSV/HMPV/Influenza A+B Combo Rapid Test (Nasopharyngeal Swab)', 'adenovirusrsvhmpvinfluenza-ab-combo-rapid-test-nasopharyngeal-swab-mt-0041-maxtest-dubai-uae', 'The Adenovirus/RSV/HMPV/Influenza A+B Combo Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of Adenovirus antigens, Respiratory Syncytial Virus (RSV) antigens, human metapneumovirus (HMPV) antigens, Influenza A and B antigens in human nasopharyngeal swab specimens. It is intended to aid in the rapid differential diagnosis of Adenovirus, Respiratory Syncytial Virus viral, human metapneumovirus, Influenza A and B infections.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eUntcOi4pmwz4g2iw5cuDFndHty04p2uIEyvlpua.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:18:01', '2025-06-15 22:06:35'),
(229, 'MT-0042', 'Typhoid IgM Rapid Test Cassette (Whole Blood/Serum/Plasma)', 'typhoid-igm-rapid-test-cassette-whole-bloodserumplasma-mt-0042-maxtest-dubai-uae', 'The Typhoid IgM Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the simultaneous detection and differentiation of IgM types of antibodiy against Salmonella typhi (S. typhi) in human whole blood, serum or plasma. It is intended to be used as a screening test as an aid in the diagnosis of infection with S. typhi. Any reactive specimen with the Typhoid IgM Rapid Test Cassette needs to be confirmed with alternative testing method.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/2O6Qr3L8PgGswBI7N2A7B7NcTaThxcYJwi2xIcAv.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:20:24', '2025-06-15 22:06:35'),
(230, 'MT-0043', 'Typhoid IgG Rapid Test Cassette (Whole Blood/Serum/Plasma)', 'typhoid-igg-rapid-test-cassette-whole-bloodserumplasma-mt-0043-maxtest-dubai-uae', 'The Typhoid IgG Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the simultaneous detection and differentiation of IgG types of antibodiy against Salmonella typhi (S. typhi) in human whole blood, serum or plasma. It is intended to be used as a screening test as an aid in the diagnosis of infection with S. typhi. Any reactive specimen with the Typhoid IgG Rapid Test Cassette needs to be confirmed with alternative testing method.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/qvhcaDrIsAN7ffjB8IdnduyIhWvtlOSiUxhdMUFV.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:21:37', '2025-06-15 22:06:35'),
