(233, 'MT-0044', 'EBNA IgG Rapid Test Cassette (Whole Blood/Serum/Plasma)', 'ebna-igg-rapid-test-cassette-whole-bloodserumplasma-mt-0044-maxtest-dubai-uae', 'The EBNA IgG Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of IgG antibodies to EBNA of Epstein-Barr virus in human whole blood, serum, or plasma.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/5gwIKtDoX7TUkYerrA08ESpXabhDxKP9biAjXx0b.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-19 20:24:21', '2025-06-15 22:06:35'),
