0W\r\nPower\r\n-\r\nVoltage/Frequency\r\n220V，50/60Hz\r\nDimension[D×W×H]\r\n1030*510*1370mm\r\nWeight\r\n-\r\nPermissible ambient temperature\r\n5-40℃\r\nPermissible ambient humidity\r\n≤80%RH\r\nProtection Class\r\nIP20\r\nUSB Interface\r\n-\r\nSafety features\r\nMotor over current protection, earth leakage protection, dry heating protection，overheat protection function\r\nApplications\r\nSuitable for large-scale applications in pilot production, biotechnology, pharmaceutical manufacturing, chemical engineering, cosmetics, and the food industry.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/Z9oKdrdJIclkA2MI3frRpvgra1pxmjQnI72L3w0y.png', 72, 1, NULL, 0, NULL, NULL, 1, '2025-04-19 20:30:37', '2025-06-15 22:06:34'),
(242, 'MW-0087', 'VC100 Vacuum Controller', 'vc100-vacuum-controller-mw-0087-maxware-dubai-uae', 'Wide range of measurement and control, 1-1,000mbar\r\nTwo control modes available Single-point control and programmed control\r\nStores up to 5 programs, each containing up to 5 steps of programming control\r\nLarge TFT touch screen display control provides easy operation\r\nAll parts in contact with vapor or liquid are made of PTFE, ceramics or other high-performance materials which effectively resists corrosion caused by organic solvents, water, acid and alkali\r\nBuilt-in vent valve can feed inert gas into system equipment\r\nOne-click decompression allows easy installation and dismantling of vacuum system\r\nCan be connected with pump power control for temporary shutdown of pump power supply after reaching stable degree of vacuum for energy conservation and environmental protection. \r\nCan also be operated in the normally open status of pump\r\nReliable and functional design to fulfill essential needs of precise vacuum regulation\r\n\r\nPRODUCT PARAMETERS\r\nCat.No.\r\n6031100300\r\nVacuum setting range\r\n1-1000mbar\r\nControl mode\r\nSingle-point control mode, Programmed control mode\r\nControl program\r\nCan store up to 5 programs, each containing 5-step control (capable to set the degree of vacuum and time)\r\nSetting method\r\nTouch screen setting\r\nDisplay\r\n5\'\' TFT\r\nSensor overload pressure\r\n1,500mbar\r\nCompatible conditions with vacuum pump\r\nPower of 50Hz vacuum pump ≤400W；Power of 60Hz vacuum pump ≤500W\r\nConnector diameter\r\n8mm\r\nMaterials in contact with vapor\r\nPTFE, PP, silicone and ceramics\r\nPower\r\n600W\r\nVoltage,Frequency\r\n110-240V,50/60Hz\r\nOverall dimensions [WxDxH]\r\n189x207x193mm\r\nWeight\r\n4.0kg\r\nPermissible ambient temperature\r\n10-40℃\r\nPermissible ambient humidity\r\n≤80% RH\r\nApplications\r\n-', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/8w5gLuxFMcZvQwZzTgyMLOtwLnWFtGlN2ewU36Me.png', 72, 1,