(320, 'MM-0005', 'LA-100 Handheld Coagulation Analyzer', 'la-100-handheld-coagulation-analyzer-mm-0005-lansionbiotech-dubai-uae', 'The handheld coagulation analyzer is used in conjunction with the electrochemical kit produced by Lansion Biotechnology Co., Ltd., and can be used for quantitative measurement of prothrombin time (PT) and activated partial thromboplastin time (APTT), fibrinogen (FIB), thrombin time (TT), activated clotting time (ACT) in human whole blood or peripheral blood. The test results are used for assisting clinical diagnosis.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/qIfc4dMREkd1PL33U83ocf9YmJWFhnOR3U4jPUEI.png', 91, 3, NULL, 0, NULL, NULL, 1, '2025-04-22 19:02:47', '2025-06-15 22:06:36'),
(321, 'MM-0006', 'LA-100 Handheld Coagulation Analyzer-for Pet', 'la-100-handheld-coagulation-analyzer-for-pet-mm-0006-lansionbiotech-dubai-uae', 'Medication monitoring: prevention of diffuse intravascular coagulation conditions during infusion and monitoring of coagulation therapy effects lntraoperative monitoring.\r\nBlood transfusion therapy: monitoring coagulation function when using blood transfusion to treat acute blood loss, anemia, sepsis, micro virus, canine distemper, jaundice and other diseases.\r\nSurgical procedures: pet sterilization, cesarean section, foreign body extraction, gastric torsion repositioning and fixation, splenectomy, liver tumor resection, thoracotomy, internal fixation of fracture, patella repositioning, skid reconstructive surgery, femoral head resection artificial femoral head replacement and other shell pre-operative coagulation index monitoring to reduce surgical risks.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/BRsRXp1q36PsUpv7MzravwIrZMESQaRGXvsGKKOH.png', 93, 3, NULL, 0, NULL, NULL, 1, '2025-04-23 10:53:06', '2025-06-15 22:06:36'),
(322, 'MM-0007', 'Coagulation Analyzer Reagents', 'coagulation-analyzer-reagents-mm-0007-lansionbiotech-dubai-uae', 'Coagulation tests are becoming common and routine in the clinical laboratory.\r\nThey are mainly applied to the pre-operative examination, the pre-thrombosis examination and the monitoring of clinical oral anticoagulants patients. It\'s requested to test PT/INR, TT, APTT and FIB before patient surgery. ACT is an effective indicator for detecting the anticoagulant effect of heparin and one of the most effective mean to ensure the safety and success of surgery.\r\n\r\n \r\n\r\n1 Strip, 6 Reasults, 20μl, 8 minutes\r\n\r\n \r\n\r\nSingle Test or Combine Test\r\nPT (Prothrombin Time)/ INR (International Normalized Ratio)\r\nTT (Thrombin Time)    ACT (Activated Clotting Time)\r\nFIB (Fibrinogenstrip)   APTT (Activated Partial Thromboplastin Time)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/pTpfU4UeblqPFnDENWXYztXKbly1ZnBFgS2uyuqW.png', 91, 3, NULL, 0, NULL, NULL, 1, '2025-04-23 10:54:18', '2025-06-15 22:06:36'),
