(338, 'MW-0095', 'Wooden Tongue Depressor', 'wooden-tongue-depressor-mw-0095-maxware-dubai-uae', 'Professional single use tongue depressors/waxing spatulas manufactured from smooth wood with rounded tips. Used by healthcare professionals to view the back of the throat and mouth.\r\n\r\nGENC-1084 Wooden Tongue Depressor Adult (150x18x1.6mm), Non-Sterile 100pcs/bx, 50bxs/ctn\r\nGENC-1085 Adult (150x18x1.6mm), Sterile 100pcs/bx, 50bxs/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/2zSMyw7T3OmxZmaHGA6FwBkHtxT1oXD7QcG34XLJ.jpg', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:17:05', '2025-06-15 22:06:34'),
(339, 'MW-0096', 'Sterilization Reel Heat Sealing Flat Reel Paper + Blue Film', 'sterilization-reel-heat-sealing-flat-reel-paper-blue-film-mw-0096-maxware-dubai-uae', 'They assure reliable and effective protection of the medical instruments against contamination with bacteria from the time of sterilization until use of the sterile medical instruments.\r\n\r\nGENC-1073 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 50mmx200m 12rolls/ctn\r\nGENC-1066 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 70mmx200m 8rolls/ctn\r\nGENC-1062 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 75mmx200m 8rolls/ctn\r\nGENC-1070 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 100mmx200m 6roll/ctn\r\nGENC-1060 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 150mmx200m 1roll/pk, 4roll/ctn\r\nGENC-1071 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 200mmx200m 2rolls/ctn\r\nGENC-1061 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 250mmx200m 2rolls/ctn\r\nGENC-1072 Sterilization Reel Heat Sealing Flat Reel, Paper + Blue Film Size- 300mmx200m 2rolls/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/CPymHMNcovq1UMYela5OojWlpI9idxe9bLueFufd.jpg', 94, 1, NULL, 1, '\"[\\\"50mmx200m\\\",\\\"70mmx200m\\\",\\\"75mmx200m\\\",\\\"100mmx200m\\\",\\\"150mmx200m\\\",\\\"200mmx200m\\\",\\\"250mmx200m\\\",\\\"300mmx200m\\\"]\"', NULL, 1, '2025-04-24 05:19:44', '2025-06-15 22:06:34'),
(340, 'MW-0097', 'Sterilization Pouch (Self Sealing Flat Pouch)', 'sterilization-pouch-self-sealing-flat-pouch-mw-0097-maxware-dubai-uae', 'The Sterilization Pouches utilize a transparent compound film for easy tool organization when cleaning. Each pouch also has an external indicator system that changes color once sterilization is done, depending on the method used. The indicator arrow turns brown on steam or autoclave and yellow when EO is processed. The tool bags also feature a reliable sealing system that ensures a tight seal without the need for any professional sealing device or added heat. The system also makes sure to prevent penetration as well tears and other damages that may be caused by sharp tools. The bag’s adhesive strip can serve as a thumb notch to prevent burns when sterilizing.\r\n\r\nGENC-5028 Sterilization Pouch (Self Sealing Flat Pouch) 2.25 ”x 4”(57 x100mm), Paper + Blue Film 200pcs/box,30boxes/ctn\r\nGENC-5029 Sterilization Pouch (Self Sealing Flat Pouch) 2.75″ X 10″ (70x260mm ) Paper + Blue Film, 200pcs/box,20box/ctn\r\nGENC-1068 Sterilization Pouch (Self Sealing Flat Pouch) 3.5” x 6.5” (90x165mm) , Paper + Blue Film 200pcs/box,40box/ctn\r\nGENC-1059 Sterilization Pouch (Self Sealing Flat Pouch) 3.5″ X 10″ (90x260mm ), Paper + Blue Film 200pcs/box, 20 box/ctn\r\nGENC-1065 Sterilization Pouch (Self Sealing Flat Pouch) 6′ x 9″ (140 X 230 mm) Paper + Blue Film 200pcs/box,10box/ctn\r\nGENC-1069 Sterilization Pouch (Self Sealing Flat Pouch) 7.5″ X 13″ (190x330mm) , Paper + Blue Film 200pcs/box, 5box/ctn\r\nGENC-1069 Sterilization Pouch (Self Sealing Flat Pouch) 11.8″ X 18″ (300x460mm) , Paper + Blue Film 200pcs/box, 5box/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/08dt4gSGs1isBATbJ1duQlGp8a2RmvVfC2e5i13M.png', 94, 1, NULL, 1, '\"[\\\"2.25\'\'x 4\'\' (57 x100mm) Paper + Blue Film\\\",\\\"2.75\\\\\\\" X 10\\\\\\\" (70x260mm) Paper + Blue Film\\\",\\\"3.5\'\' x 6.5\'\' (90x165mm) Paper + Blue Film\\\",\\\"3.5\\\\\\\" X 10\\\\\\\" (90x260mm) Paper + Blue Film\\\",\\\"6\' x 9\\\\\\\" (140 X 230 mm) Paper + Blue Film\\\",\\\"7.5\\\\\\\" X 13\\\\\\\" (190x330mm) Paper + Blue Film\\\",\\\"11.8\\\\\\\" X 18\\\\\\\" (300x460mm) Paper + Blue Film\\\"]\"', NULL, 1, '2025-04-24 05:28:27', '2025-06-15 22:06:34');
INSERT INTO `products` (`id`, `sku`, `name`, `slug`, `description`, `price`, `price_aed`, `procurement_price_aed`, `procurement_price_usd`, `image_url`, `category_id`, `brand_id`, `supplier_id`, `has_size_options`, `size_options`, `pdf_file`, `is_active`, `created_at`, `updated_at`) VALUES
(341, 'MW-0098', 'Saliva Ejector', 'saliva-ejector-mw-0098-maxware-dubai-uae', 'Narrow tubular device providing suction to draw saliva, blood, and debris from the mouth of a dental patient in order to maintain a clear operative field White or Clear. Perforated suction tube that sucks out moisture from your mouth.\r\n\r\nGENC-1052 Saliva Ejector Non-Removable, Total Length: 150±2mm, Dia.: 6.8±0.5mm, Fixed Clear Cap and Tube, with copper interior wiring with chrome plated 100pcs/bag,20bag/ctn\r\nGENC-1053 Removable tip, Length: 150±2mm, Dia.: 6.8±0.5mm 100pcs/bag,20bag/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/szz7FXvT2Ojl3hhJrAL0RhaWEJIH2F1ECx7pkj26.jpg', 94, 1, NULL, 1, '\"[\\\"Non Removable\\\",\\\"Removable\\\"]\"', NULL, 1, '2025-04-24 05:30:07', '2025-06-15 22:06:34'),
(342, 'MW-0099', 'Steam Indicator Strip', 'steam-indicator-strip-mw-0099-maxware-dubai-uae', 'Steam Indicator Strips for use in pouches, tubing, autoclave bags, CSR wraps cassettes and packs for monitoring steam sterilization. Only use in chemical monitoring of steam sterilization and can not be used in biological monitoring. GENC-1063 Indicator Strip 10cm x 1.5cm, For steam 200pcs/box, 20000pcs/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/RZFMrp1ftkP5HhkI56m4xCjp5JEm4yPQofKvOVUM.jpg', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:31:58', '2025-06-15 22:06:34'),
(343, 'MW-0100', 'Face Mask', 'face-mask-mw-0100-maxware-dubai-uae', 'This pack contains 50 pieces disposable face masks (face coverings) made from three layers of comforting-to-skin fabric to cover the nose and mouth. They feature a soft ear loop fastening and comfortable pleated design.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/JM6zryo3YNmpgluMioOVYC7jqqcreDPUnj00RYIN.jpg', 94, 1, NULL, 1, '\"[\\\"3 Ply Ear Loop Blue\\\",\\\"3 Ply Ear Loop White\\\",\\\"3 Ply Ear Loop Black\\\"]\"', NULL, 1, '2025-04-24 05:33:24', '2025-06-15 22:06:34'),
(344, 'MW-0101', 'Dental Tray', 'dental-tray-mw-0101-maxware-dubai-uae', 'Dental impression trays hold the impression material while the impression is being created intraorally, and then provide a firm backing to make sure the impression is free of distortions as it finishes setting. During impression making the tray facilitate insertion & removal of impression material from the patient’s mouth. GENC-1016 Dental tray 284*183*17mm,PET,white 100pcs/box,4boxs/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/k4RkYdLYfP4EyweNnJhXhYSE1pMwHwy9RWTgZibM.jpg', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:34:55', '2025-06-15 22:06:34'),
(345, 'MW-0102', 'Dental Bib', 'dental-bib-mw-0102-maxware-dubai-uae', 'Disposable Patient Bibs, Dentist Bibs, Waterproof Tattoo Bibs, Dental Patient Bibs, Dental Bib, Dental Napkins Dental bibs and towels form an effective preliminary barrier against contamination. Perfect for the dental office or orthodontic clinic, stock up on these popular, affordable disposables 3ply(16+16+8g/m2) without tie.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/jhOuvh42YgxzGplqNYerZbo7BF9Fs2toHYMx3UF5.jpg', 94, 1, NULL, 1, '\"[\\\"3ply(16+16+8g\\\\/m2) without tie 330x450mm Blue color\\\"]\"', NULL, 1, '2025-04-24 05:36:25', '2025-06-15 22:06:34'),
(346, 'MW-0103', 'Bowie Dick Test Pack', 'bowie-dick-test-pack-mw-0103-maxware-dubai-uae', 'Bowie-Dick (Air-Removal) tests evaluate the performance of pre vacuum sterilizers by confirming adequate air removal from the sterilizer chamber. These gases act like a shield between the steam and the item, potentially shielding bacteria and preventing proper sterilization. GENC-1007 BOWIE DICK TEST PACK 11.5×12.5cm 100pcs/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/k1HLNyu2CTBUU2RlVuEljZzB8cJwhFZG7hApBn7Q.png', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:37:32', '2025-06-15 22:06:34'),
(347, 'MW-0104', 'Barrier Film', 'barrier-film-mw-0104-maxware-dubai-uae', 'Barrier films are usually multilayer films that have been designed to be impervious to gas migration.\r\n\r\nGENC-1004 Barrier film Blue, 4” x (6”x1200) 8rolls/ctn\r\nGENC-1005 Clear, 4” x (6”x1200) 8rolls/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/7aMmG8bqzWKr707VhxDAGFH9HIgqpyV2NKWuSCcZ.jpg', 94, 1, NULL, 1, '\"[\\\"Blue 4 x (6x1200)\\\",\\\"Clear 4 x (6x1200)\\\"]\"', NULL, 1, '2025-04-24 05:38:19', '2025-06-15 22:06:34'),
(348, 'MW-0105', 'MFLAB Auto Clave Steam Tape', 'mflab-auto-clave-steam-tape-mw-0105-maxware-dubai-uae', 'Autoclave tape is normally made of a pressure sensitive adhesive tape comprising an indicator. Designed to identify containers that will undergo sterilization in steam autoclaves, this white autoclave tape comes with nearly invisible marking strips that will turn black when put through a sterilization cycle. Steam Sterilization Tape is used to confirm that the labeled material has been autoclaved. GENC-5005 Auto clave Steam Tape 19mm x 50m 1roll/PE bag, 117rolls/ctn', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/PhLI5WphPcxwUCvnzD50QaatBcFdLppGgfF12eLP.jpg', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:40:48', '2025-06-15 22:06:34'),
(349, 'MW-0106', 'Dental Cotton Roll 10mm X 38mm', 'dental-cotton-roll-10mm-x-38mm-mw-0106-maxware-dubai-uae', 'Not easily be broken. Easy to grip and practical for teeth cleaning supplies Dental cotton rolls are used to absorb saliva and other fluids to help keep operative areas free of excess moisture. GENC-1015 Dental Cotton Rolls, Size: 2 10mm x 38mm, 50pc/bndl,20bndl/bx', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/tSt6KAqlqHrRRzAsSmZPh2gg9an8y6iI06SVKsLx.jpg', 94, 1, NULL, 0, NULL, NULL, 1, '2025-04-24 05:41:38', '2025-06-15 22:06:34'),
(350, 'MT-0105', 'Legionella pneumophila Rapid Test', 'legionella-pneumophila-rapid-test-mt-0105-maxtest-dubai-uae', 'Legionella pneumophila Rapid Test Cassette(Urine) is an in vitro diagnostic test based on immunochromatographic assay. It is designed for detection of soluble antigen from Legionella pneumophila serogroup 1 in human urine specimen.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/Zq0ARZyKNebegJOQ7TgjqCOq96CZwT1ctr4wG5WV.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 11:53:00', '2025-06-15 22:06:35'),
(351, 'MT-0106', 'Strep A Rapid Test', 'strep-a-rapid-test-mt-0106-maxtest-dubai-uae', 'The Strep A Rapid Test is for the qualitative detection of Strep A antigens from throat swab specimens to aid in the diagnosis of Group A Streptococcal infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/sIObOs5GRkuqA6y1ZBOfzQvZEKsPLYyL32QRELyQ.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 11:55:37', '2025-06-15 22:06:36'),
(352, 'MT-0107', 'Syphilis Rapid Test (S/P)', 'syphilis-rapid-test-sp-mt-0107-maxtest-dubai-uae', 'The Syphilis Rapid Test is for the qualitative detection of antibodies (IgG and IgM) to Treponema Pallidum (TP) in specimen to aid in the diagnosis of Syphilis.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/XPLYx1CkXtba16ljbb582z5oNPdI21MSOTwS0Wq9.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 11:57:08', '2025-06-15 22:06:36'),
(353, 'MT-0108', 'Syphilis Rapid Test (WB/S/P)', 'syphilis-rapid-test-wbsp-mt-0108-maxtest-dubai-uae', 'The Syphilis Rapid Test is for the qualitative detection of antibodies (IgG and IgM) to Treponema Pallidum (TP) in specimen to aid in the diagnosis of Syphilis.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/UVDJetWxE6gdbMCloNuXIiunZvvEShf1NWYK0XQA.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 11:58:12', '2025-06-15 22:06:36'),
(354, 'MT-0109', 'Mycoplasma pneumoniae Antigen Rapid Test', 'mycoplasma-pneumoniae-antigen-rapid-test-mt-0109-maxtest-dubai-uae', 'Mycoplasma pneumoniae Antigen Rapid Test is for the qualitative detection of Mycoplasma pneumoniae(M. pneumoniae) antigens in human throat swabs to aid in the rapid differential diagnosis of Mycoplasma pneumoniae infections.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9XRbtKTlCeyBqwULPpCbwDbFRPnMg5dIaIAfGqaU.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:02:29', '2025-06-15 22:06:36'),
(355, 'MT-0110', 'Mycoplasma pneumoniae IgM Rapid Test', 'mycoplasma-pneumoniae-igm-rapid-test-mt-0110-maxtest-dubai-uae', 'The Mycoplasma pneumoniae IgM Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of IgM antibody to Mycoplasma pneumoniae in human whole blood, serum, or plasma to aid in the diagnosis of Mycoplasma pneumoniae infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/IB06HwS0L4Rr8MQLuftVdyzpiIxq2atOHBqvZVZN.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:03:14', '2025-06-15 22:06:36'),
(356, 'MT-0111', 'Mycoplasma pneumoniae IgG/IgM Combo Rapid Test', 'mycoplasma-pneumoniae-iggigm-combo-rapid-test-mt-0111-maxtest-dubai-uae', 'The Mycoplasma pneumoniae IgG/IgM Combo Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of IgG and IgM antibodies to Mycoplasma pneumoniae in whole blood, serum, or plasma to aid in the diagnosis of Mycoplasma pneumoniae infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/o4HTCIP5hVuawhBLlcSU5jaCsu6bp6gV3Ebq8zTb.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:04:03', '2025-06-15 22:06:36'),
(357, 'MT-0112', 'MONO Rapid Test', 'mono-rapid-test-mt-0112-maxtest-dubai-uae', 'The MONO Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of Infectious Mononucleosis heterophile antibodies in human whole blood, serum or plasma as an aid in the diagnosis of Infectious Mononucleosis.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/pFVpbVodg2g0e1OJSkLKgcguI4ONowopPrVDOusd.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:05:13', '2025-06-15 22:06:36'),
(358, 'MT-0113', 'Adenovirus Antigen Rapid Test Cassette (Swab)', 'adenovirus-antigen-rapid-test-cassette-swab-mt-0113-maxtest-dubai-uae', 'The Adenovirus Antigen Rapid Test Cassette (Swab) is a rapid chromatographic immunoassay for the qualitative detection of Adenovirus antigen in eye conjunctive swab, throat swab and nasopharyngeal swab as an aid in the diagnosis of adenovirus infections.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ZdWck2USUeLKKbpzBn8SnxugR6yjfTyN0PioROpe.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:07:29', '2025-06-15 22:06:36'),
(359, 'MT-0114', 'HPIV Rapid Test', 'hpiv-rapid-test-mt-0114-maxtest-dubai-uae', 'The HPIV Rapid Test (Nasopharyngeal Swab) is a rapid chromatographic immunoassay for the qualitative detection of human parainfluenza virus antigens in human nasopharyngeal sawb as an aid in the diagnosis of HPIV infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/IGVSrStP2eZ1i4tAJzHdrXODFZLlwT7aExlMbues.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:16:13', '2025-06-15 22:06:36'),
(360, 'MT-0115', 'HMPV Rapid Test', 'hmpv-rapid-test-mt-0115-maxtest-dubai-uae', 'The HMPV Rapid Test (Nasopharyngeal Swab) is a rapid chromatographic immunoassay for the qualitative detection of human metapneumovirus antigens in human nasopharyngeal swab as an aid in the diagnosis of HMPV infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/HZ6Es1VwTLETPvFp0uE7P6BQAHYDSYAnWjeK17DP.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:17:21', '2025-06-15 22:06:36'),
(361, 'MT-0116', 'Tuberculosis (TB) Rapid Test', 'tuberculosis-tb-rapid-test-mt-0116-maxtest-dubai-uae', 'The Tuberculosis Rapid Test is a rapid chromatographic immunoassay for the qualitative detection of anti-TB antibodies (Isotypes IgG, IgM and IgA) in human whole blood, serum or plasma specimens.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/GrWFNBwzRO0YfqaJO11OVwLmQ21giRr8Iw6BJvIs.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:19:27', '2025-06-15 22:06:36'),
(362, 'MT-0117', 'Tetanus Rapid Test', 'tetanus-rapid-test-mt-0117-maxtest-dubai-uae', 'The Tetanus Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of antibodies to Tetanus toxin in human whole blood, serum or plasma to aid in the diagnosis of Tetanus toxin infection.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/f6LbMynXnFJ8dYw3INXgcnaCWXdfNmhmjvhKs6pd.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:20:30', '2025-06-15 22:06:36'),
(363, 'MT-0118', 'Brucella Abortus Antigen Rapid Test', 'brucella-abortus-antigen-rapid-test-mt-0118-maxtest-dubai-uae', 'The Brucella Abortus Antigen Rapid Test Cassette (Whole Blood/Serum/Plasma) is a rapid chromatographic immunoassay for the qualitative detection of Brucella abortus antigen in human whole blood, serum or plasma specimen.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/YlklZaujFERc2M7ywQqwupCxx12YgpokODIy4M5W.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:21:28', '2025-06-15 22:06:36'),
(364, 'MT-0119', 'Influenza A+B Rapid Test', 'influenza-ab-rapid-test-mt-0119-maxtest-dubai-uae', 'The Influenza A+B Rapid Test Cassette is a rapid chromatographic immunoassay for the qualitative detection of influenza A and B antigens in human nasopharyngeal swab, throat swab or nasal aspirate specimens. It is intended to aid in the rapid differential diagnosis of influenza A and B viral infections.\r\n\r\nProduct Features\r\n\r\nFast results  \r\n\r\nEasy visual interpretation\r\n\r\nSimple operation, no equipment required \r\n\r\nHigh accuracy', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9ex8MgjvqzUJLPBvKdB8zbHpqO7RUwAiDBiVYTue.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-04-28 12:26:37', '2025-06-15 22:06:36'),
(366, 'MM-0008', 'Table Top Autoclave Class N Series', 'table-top-autoclave-class-n-series-mm-0008-biobase-dubai-uae', 'Introduction:\r\nBKM-K18/23N sterilizer series is an N-level sterilizer. It discharges the cold air in the sterilization chamber by gravity displacement, saturates the internal steam, and reaches the set pressure and temperature. To achieve the purpose of sterilizing the items to be sterilized. Suitable for stomatology, ophthalmology, beauty, operating room and other places. It is suitable for sterilization of glassware, bare metal utensils, and unencapsulated solid instruments.\r\n\r\nFeatures:\r\n\r\n1. High-quality material: the sterilization chamber is made of high-quality S30408 stainless steel electropolished.\r\n\r\n2. Steam generation method: the main body is heated, no external steam source is required.\r\n\r\n3. Operation interface: 3.5-inch capacitive color display screen is used to display pressure, temperature, time, alarm code and other information in real time, which is convenient for users to observe. When the sterilization cycle is over, a buzzer will sound.\r\n\r\n4. Sterilization record: standard USB interface, optional printer, record program data.\r\n\r\n5. New storage rack: increase the utilization space of the sterilization chamber, and the selection space for sterilization load is larger.\r\n\r\n6. Control system: controlled by single chip microcomputer, automatic control of heating, sterilization and exhaust, without too much manual operation.\r\n\r\n7. One-key start on the operation panel, using mechanical keys, the number of actions≥100,000 times.\r\n\r\n8. Two sterilization procedures at 121°C and 134°C are selectable.\r\n\r\nSafety Protection:\r\n\r\nOver-temperature automatic protection, heating tube anti-dry protection, safety interlock device, double over-voltage protection, over-current leakage safety protection, door detection protection.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/UbtOYTxNwwO1anLgNaJs3xwwO9NXN1nVPUrnMDbR.jpg', 95, 6, NULL, 0, NULL, 'products/pdfs/QxLO1eWK0Bel4RvUrgfNpbVOWAqa6e8hIUs4THEO.pdf', 1, '2025-04-29 09:15:40', '2025-06-15 22:06:36'),
(367, 'MM-0009', 'Ducted Fume Hood FH1800(E)(Customized)', 'ducted-fume-hood-fh1800ecustomized-mm-0009-biobase-dubai-uae', 'Introduction:\r\nIn chemical laboratories, various harmful odorous gases, odors, moisture and corrosive substances are produced during experimental operations. In order to protect the safety of users and prevent the pollutants in the experiment from spreading to the laboratory, fume hoods should be used near the pollution source.\r\n\r\nStructural and Functional Characteristics：\r\n\r\n1. The shell of the fume hood is made of 1.0mm cold-rolled steel plate from Handan Iron and Steel, which has been treated with rust prevention and electrostatic spraying, and has good finish and corrosion resistance.\r\n\r\n2. The table panel is made of 1.2mm thick 316L stainless steel, which is corrosion-resistant and high-temperature resistant.\r\n\r\n3. The fume hood uses a PP centrifugal fan, and the shell and impeller are made of pp(polypropylene), which has good corrosion resistance and large air volume.\r\n\r\n4. The wind speed is adjustable in 9 gears, ranging from 0.3 to 0.6 m/s.\r\n\r\n5. An activated carbon filter is installed inside the cabinet to filter harmful gases.\r\n\r\n6. The light source illumination is greater than 800lx.\r\n\r\n7. The fume hood uses a 5mm tempered glass front window, electric lifting, equipped with a foot switch control, and the bottom of the glass is equipped with a silicone gasket for safety protection.\r\n\r\n8. The control panel uses an LCD display with a power button, fan button, fan speed adjustment button, fluorescent light button, etc., which can monitor wind speed and temperature and humidity.\r\n\r\n9. The control system has sound and light alarm functions, including wind speed alarm and filter life alarm.\r\n\r\n10. The fume hood operation area adopts solid anti-bacterial board with a thickness of ≥5mm, which is resistant to pollution, easy to clean, antibacterial and impact-resistant. The three-stage diversion design can effectively discharge gases of different weights and is easy to disassemble, clean and replace.\r\n\r\n11. The fume hood is equipped with 2 European standard sockets, and the total power of the 2 sockets is 3kw.\r\n\r\n12. The fume hood is equipped with faucets and control valves, gas faucets and control valves, vacuum faucets and control valves, sinks and their pipe connectors', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/2s6ORpe8wU7XzZtZn45ql2ueKrMchdlem6R9Ce6c.jpg', 96, 6, NULL, 0, NULL, 'products/pdfs/GZS0DYg3ms2u8x2SZ1FTRzoohppNeEynaevct0FW.pdf', 1, '2025-05-02 16:28:02', '2025-06-15 22:06:36'),
