(376, 'MM-0018', '-86℃ ultra-low temperature freezer', '86-ultra-low-temperature-freezer-mm-0018-biobase-dubai-uae', 'Introduction:\r\nThe -86℃ Freezer is specifically designed for the long-term preservation of highly temperature-sensitive samples. It maintains sample viability and stability at extremely low temperatures, widely used in biobanking and food safety.\r\n\r\nFeatures:\r\n\r\n1. The exterior is made of spray-coated cold-rolled steel plates, the interior is constructed with SUS304 stainless steel.\r\n\r\n2. The 10.1-inch smart full-touch Android screen displays precision at 0.1℃.\r\n\r\n3. Dual independent cooling systems ensure uninterrupted operation, if one system fails, the other continues to function normally. A single system can maintain long-term stable temperatures below -80℃.\r\n\r\n4. Five-layer door seal design ensures more uniform temperature distribution and enhanced energy efficiency.\r\n\r\n5. Featuring an integrated dual-lock design, it also includes electromagnetic locks, fingerprint locks, NFC, and other functions to ensure the security of stored items.\r\n\r\n6. Equipped with smart IoT capabilities, it allows users to monitor the freezer\'s status anytime via a computer-based platform.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/FkufLbEtAsUywgs8v1cwMUgCiGs1UjyQq341enuR.jpg', 98, 6, NULL, 0, NULL, NULL, 1, '2025-05-02 16:53:38', '2025-06-15 22:06:36'),
(377, 'MM-0019', 'Vacuum Drying Oven(BOV-V/VL)', 'vacuum-drying-ovenbov-vvl-mm-0019-biobase-dubai-uae', 'Introduction:\r\nVacuum drying oven is a kind of laboratory equipment for drying and heating treatment under vacuum environment, specially designed for drying heat-sensitive, easy to decompose and easy to oxidize substances, when working, it can keep a certain degree of vacuum in the working chamber, especially some items with complex composition can also be dried quickly.\r\n\r\nFeatures:\r\n\r\n1. Outer material : cold rolled steel plate with spraying surface; inner material : SUS stainless steel plate.\r\n\r\n2. PID microprocessor temperature control with LED display.\r\n\r\n3. Integral molded silicone rubber door seal ring for good air tightness.\r\n\r\n4. Toughened bulletproof double glazed doors.\r\n\r\n5. With parameter memory function, automatically resume operation when power restoration.\r\n\r\n6. The heater is located in the chamber on the shelf, and separate temperature control, with a short heating time, the same level of temperature uniformity is good.(Except BOV-30L/50L)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/h7O2idiMYIElmfFyl58XxWgWOcsw6gmxq149bh3D.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/sEzMOKNGR3S3SYfvhFaeCdEZz7m3fWe0lhpfzieJ.pdf', 1, '2025-05-02 17:04:46', '2025-06-15 22:06:36'),
(378, 'MM-0020', 'Forced Air Drying Oven BJPX-HG Series', 'forced-air-drying-oven-bjpx-hg-series-mm-0020-biobase-dubai-uae', 'Application:\r\nThis product is used for drying, disinfecting, melting wax and sterilizing non-flammable and non-explosive items and non-volatile items in industrial and mining colleges and universities, enterprises, scientific research, food processing, medical institutions and various laboratories. For example, drying of experimental samples, food, glassware, thermal hardening, thermal denaturation, thermal softening and water removal of chemical substances, dry heat sterilization of instruments and utensils in bioengineering, aging and drying of electronic components, etc.\r\n\r\nFeatures：\r\n\r\n1. LCD display screen, with built-in temperature deviation calibration function.\r\n\r\n2. The inner tank is made of high-quality stainless steel, with semi-circular four-corner design.\r\n\r\n3. It has an over-temperature alarm system function to prevent damage to the instrument due to excessive temperature.\r\n\r\n4. The unique thermal circulation circuit has a fan to form forced convection, so that the average temperature in the working room is better.\r\n\r\n5. The perspective window structure design is convenient for observing the internal situation of the equipment.\r\n\r\n6. Good thermal insulation performance and low surface temperature of the equipment.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/X9nwv78WmDk12FAzIv4cDVNB72obs5kQK59edg6Y.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/ROJZ4RO5ahosKj6awCm5ZCHTDqdOUl3A5z0MtSCS.pdf', 1, '2025-05-02 17:06:15', '2025-06-15 22:06:36'),
(379, 'MM-0021', 'Dual-use Drying Oven B0V-D series', 'dual-use-drying-oven-b0v-d-series-mm-0021-biobase-dubai-uae', 'Introduction:\r\nThe drying oven/incubator can be used as an incubator for the incubation of bacteria, molds, microorganisms, and tissue cells. As a drying oven, it can be used for baking, drying, heat treatment, disinfection and sterilization. Applicable to universities, research and production department.\r\n\r\nFeatures:\r\n\r\n1. Outer material: cold-rolled steel plate sprayed on the surface; inner material: SUS stainless steel plate.\r\n\r\n2. Air inlet and outlet on the back, the air volume can be adjusted.\r\n\r\n3. Adopt silicone rubber sealing strip and double glass door observation window, easy and clear observation.   \r\n\r\n4. Microcomputer controller, precise and reliable temperature control.  \r\n\r\n5. The inner box is designed with a circular arc structure, which is easy to clean.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/qZSUFGY2iw8Lh5yHg9cxlDYGeDrjhSImMctaKgcU.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/5p67w1BDW7kMCZ5HQe2wIrslbRCMj6gX96AQ6t7r.pdf', 1, '2025-05-02 17:08:08', '2025-06-15 22:06:36'),
