(381, 'MM-0023', 'Constant-temperature Drying Oven BJPX-HDO Series', 'constant-temperature-drying-oven-bjpx-hdo-series-mm-0023-biobase-dubai-uae', 'Introduction:\r\nIt is suitable for drying samples of powders, insects and other tiny objects to avoid the samples flying up due to wind. This product is used for drying and melting wax of non-flammable and non-explosive items and non-volatile items in industrial and mining enterprises, colleges and universities, scientific research units, food processing, medical units and various laboratories.\r\n\r\nFeatures:\r\n\r\n1. LCD temperature display, with built-in temperature deviation calibration function.\r\n\r\n2. Over-temperature alarm and automatic fault detection alarm function, equipped with leakage current and overvoltage protector.\r\n\r\n3. Accurately control the heating time, timing error≤1%.\r\n\r\n4. Bottom heating, natural convection.\r\n\r\n5. Cold-rolled steel plate surface sprayed with plastic, stainless steel plate liner material, arc structure design, easy to clean.\r\n\r\n6. The box door has a double-layer high-temperature resistant glass observation window.\r\n\r\n7. It has parameter memory function and automatically recovers when power is on.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/K9eve38zRqbgiAqwB7ZmMx1mzH5MOkQaEY1fwVNQ.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/PHxDiTD6FctLkfhgbSXhwLDtN2ahaAjALoyw2Cvu.pdf', 1, '2025-05-02 17:09:54', '2025-06-15 22:06:36'),
