(385, 'MM-0027', 'Drying Oven/Incubator (Dual Purpose) BOV-D35S BOV-D50S BOV-D70S BOV-D140S BOV-D240S', 'drying-ovenincubator-dual-purpose-bov-d35s-bov-d50s-bov-d70s-bov-d140s-bov-d240s-mm-0027-biobase-dub', 'Application:\r\nThis product has a wide application for both drying and culturing. Being a product of high quality and reliability, it can be of direct help in colleges & universities, scientific research institutes and production. It makes it possible for the users to save the space and enhance work efficiency.\r\n\r\nFeature:\r\n\r\nInner bladder of mirror stainless steel, four corners rounded, easy for cleaning, space between shelves adjustable.\r\n\r\nMicrocomputer-based smart controller, temperature control of high prevision and reliability, protection against excessive temperature, sensor failure, creepage, over-current, etc., sound & light alarming, timing function.\r\n\r\nForced hot air circulation design to ensure temperature uniformity in the operating chamber.\r\n\r\nSilicon rubber sealing and double- -layer observation window, making observation easy.\r\n\r\nOptional RS-485 portal for connection with embedded printer, enabling record of variations of temperature parameters. (optional)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/vWMsxVv95AraqKQRYP7FyTcYRkcFqBUpM7p2BusB.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/nLHyXW0roHFE7haPNsxN2xjathCkHxWcPsSnLqyU.pdf', 1, '2025-05-02 17:14:28', '2025-06-15 22:06:36'),
(386, 'MM-0028', 'Forced Air Drying Oven(BOV-TF)', 'forced-air-drying-ovenbov-tf-mm-0028-biobase-dubai-uae', 'Features:\r\n\r\n* External material: cold-rolled steel with anti-bacteria powder coating.\r\n\r\n* Stainless steel inner chamber, round angle structure, adjustable shelves.\r\n\r\n* Double-layer glass observation window, adjustable airtight buckle lock.\r\n\r\n* PID control with LED display\r\n\r\n* Over-temperature protection.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/nynCxMoBxCo8oPjeOROUeAOx495Lf5n9B7ynslFN.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/6VbhOPb0fSGO1MDYd5evp7RT6cfYuL4XU8Ykgah5.pdf', 1, '2025-05-02 17:16:00', '2025-06-15 22:06:36'),
(387, 'MM-0029', 'Drying Oven/Incubator (Dual Purpose)', 'drying-ovenincubator-dual-purpose-mm-0029-biobase-dubai-uae', 'Application:\r\nThis product has a wide application for both drying and culturing. Being a product of high quality and reliability, it can be of direct help in colleges & universities, scientific research institutes and production. It makes it possible for the users to save the space and enhance work efficiency.\r\n\r\nFeature:\r\n\r\nInner bladder of mirror stainless steel, four corners rounded, easy for cleaning, space between shelves adjustable.\r\n\r\nMicrocomputer-based smart controller, temperature control of high prevision and reliability, protection against excessive temperature, sensor failure, creepage, over-current, etc., sound & light alarming, timing function.\r\n\r\nForced hot air circulation design to ensure temperature uniformity in the operating chamber.\r\n\r\nSilicon rubber sealing and double- -layer observation window, making observation easy.\r\n\r\nOptional RS-485 portal for connection with embedded printer, enabling record of variations of temperature parameters. (optional)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/Nk5QH0wQnBy8iBX7jyzC8NMYsB0SiS64H0Jyw6MR.jpg', 73, 6, NULL, 0, NULL, 'products/pdfs/rWA1Uq2u8GUWH64cnojSL6nETTC0kBHogkfLbANt.pdf', 1, '2025-05-02 17:17:25', '2025-06-15 22:06:36'),
(388, 'MM-0030', 'HiPette Colorful Fully Autoclavable Mechanical Pipette', 'hipette-colorful-fully-autoclavable-mechanical-pipette-mm-0030-dlab-dubai-uae', 'Using different color scales to mark the pipettes helps users quickly identify the required pipetter, reducing the risk of choosing the wrong range and improving experimental efficiency and accuracy.\r\nFor novice experimental personnel, identifying different colors makes it easier to understand and remember, simplifying the training process.\r\nDifferent colors also help organize and manage pipettes within the laboratory, making it more orderly.\r\nDLAB\'s new generation of fully autoclavable manual pipettes feature an excellent ergonomic design with an ultra-light body weighing less than 100g, reducing fatigue and offering a smoother, more comfortable pipetting experience;\r\nThe pipettes are easy to press with a first stop force of 4N and a second stop force of 10N, providing a comfortable single-handed pipetting experience;\r\nThe single-channel adjustable range includes 10, covering 0.1ul to 10ml;\r\nA new piston structure and screw mechanism ensure precise aspiration and dispensing, with a counter increment of one-thousandth of the range;\r\nA one-button range lock effectively prevents pipetting errors due to misoperation and aids in the accurate transfer of small volumes of liquid;\r\nThe range adjustment is smooth and tactile;\r\nConstructed with new materials, the pipettes are autoclavable without disassembly, UV sterilizable, and resistant to strong chemical corrosion;\r\nThey come with a separate filter to reduce volatile reagents from entering the body, preventing over-aspiration and piston corrosion due to improper operation;\r\nEasy to disassemble for maintenance; with the accessory tools provided, calibration and repairs can be conveniently and quickly performed.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/w71MTaoZa18LWulr9dTtrGzyV4UAjZJqzojN8Ni1.webp', 75, 7, NULL, 1, '\"[\\\"0.1-2.5\\\\u03bcL\\\",\\\"0.5-10\\\\u03bcL\\\",\\\"2-20\\\\u03bcL\\\",\\\"5-50\\\\u03bcL\\\",\\\"10-100\\\\u03bcL\\\",\\\"20-200\\\\u03bcL\\\",\\\"30-300\\\\u03bcL\\\",\\\"100-1000\\\\u03bcL\\\",\\\"500-5000\\\\u03bcL\\\",\\\"1000-10000\\\\u03bcL\\\",\\\"0.1-2.5\\\\u03bcL\\\\uff08Metal Tip)\\\",\\\"0.5-10\\\\u03bcL\\\\uff08Metal Tip)\\\",\\\"2-20\\\\u03bcL\\\\uff08Metal Tip)\\\"]\"', NULL, 1, '2025-05-03 10:31:56', '2025-06-15 22:06:36'),
(389, 'MM-0031', 'HiPette Fully Autoclavable Mechanical Pipette', 'hipette-fully-autoclavable-mechanical-pipette-mm-0031-dlab-dubai-uae', 'Introducing the new generation of fully autoclavable manual pipettes - the DLAB pipette.\r\nErgonomic Design: The DLAB pipette is designed with excellent ergonomics that reduce fatigue and provide a smoother and easier pipetting experience.\r\nSmooth and Effortless Operation: With a one-stop point of 4N and two-stop points of 10N, the DLAB pipette offers a comfortable single-handed pipetting experience with smooth and effortless operation.\r\nMultiple Volume Range: The DLAB pipette offers 12 different single-channel adjustable volume , ranging from 0.1 µl to 10 ml, making it ideal for various laboratory applications.\r\nPrecise Volume Setting: The DLAB pipette features a new piston and metal screw structure, ensuring precise suction and dispensing of liquids. Its counter increment is one thousandth of the volume range, making it easy to set and read.\r\nOne-Click Volume Lock: The DLAB pipette has a one-click volume lock feature that helps prevent pipetting errors caused by accidental volume changes, allowing for more accurate transfer of small volumes of liquids.\r\nSmooth Volume Adjustment: The DLAB pipette offers a smooth and easy volume adjustment experience, ensuring high precision and accuracy.\r\nHigh-Quality Materials: The DLAB pipette is made of a new type of material that does not require disassembly for autoclaving or UV disinfection, and is resistant to harsh chemicals.\r\nIndividual Filter System: The DLAB pipette is equipped with an individual filter system that reduces volatile reagents from entering the pipette and causing over-aspiration or corrosion of the piston.\r\nEasy Maintenance: The DLAB pipette is easy to disassemble and comes with tools that can be used to calibrate and maintain the pipette in the laboratory.\r\nCertifications: The DLAB pipette has ISO9001:2015 and ISO 13485:2016 certifications, as well as CE marking, ensuring its quality and reliability.\r\nOnline Calibration: The DLAB pipette can be calibrated online via the official website, ensuring its accuracy and reliability.\r\nOverall, the DLAB pipette is a reliable, easy-to-use, and precise manual pipette that is ideal for various laboratory applications. With its ergonomic design, precise volume setting, and high-quality materials, the DLAB pipette is the ideal choice for any laboratory looking for a reliable and efficient pipette.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/sZTPvOTz8YXcrdcm8CJqpUyhB9BvxaHRc6XoKw9Y.png', 75, 7, NULL, 1, '\"[\\\"0.1-2.5\\\\u03bcL\\\",\\\"0.5-10\\\\u03bcL\\\",\\\"2-20\\\\u03bcL\\\",\\\"5-50\\\\u03bcL\\\",\\\"10-100\\\\u03bcL\\\",\\\"20-200\\\\u03bcL\\\",\\\"30-300\\\\u03bcL\\\",\\\"100-1000\\\\u03bcL\\\",\\\"500-5000\\\\u03bcL\\\",\\\"2000-10000\\\\u03bcL\\\",\\\"1000-5000\\\\u03bcL\\\",\\\"2000-10000\\\\u03bcL\\\"]\"', 'products/pdfs/BghXhjyFc6yAY0t3xeLOyF6b6do4PYMcyKyBc60C.pdf', 1, '2025-05-03 11:09:39', '2025-06-15 22:06:36');
