r various laboratory applications. With its ergonomic design, intuitive controls, and high-quality materials, the MicroPette Plus is the ideal choice for any laboratory looking for a reliable and efficient pipette.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/U9omof4ncXuchrABDeVPyNXIZfULSS1pXbAbqduQ.png', 75, 7, NULL, 1, '\"[\\\"0.1-2.5\\\\u03bcL\\\",\\\"0.5-10\\\\u03bcL\\\",\\\"2-20\\\\u03bcL\\\",\\\"5-50\\\\u03bcL\\\",\\\"10-100\\\\u03bcL\\\",\\\"20-200\\\\u03bcL\\\",\\\"50-200\\\\u03bcL\\\",\\\"100-1000\\\\u03bcL\\\",\\\"200-1000\\\\u03bcL\\\",\\\"1000-5000\\\\u03bcL\\\",\\\"500-5000\\\\u03bcL\\\",\\\"1000-10000\\\\u03bcL\\\",\\\"2000-20000\\\\u03bcL\\\",\\\"2-20\\\\u03bcL\\\\uff08Metal Tip\\\\uff09\\\"]\"', 'products/pdfs/RCTeQNcEDTO3xSd5OP6S9q3YxKMSBbk8PthsGxFb.pdf', 1, '2025-05-03 11:17:40', '2025-06-15 22:06:36'),
