(396, 'MM-0038', 'dPette+ Multi-functional 8-channel Electronic Pipette', 'dpette-multi-functional-8-channel-electronic-pipette-mm-0038-dlab-dubai-uae', 'Introducing the DLAB Multi-channel Electric Pipette - a versatile and efficient eight-channel electric pipetting device that simplifies the process of accurate and fast pipetting of multiple samples.\r\n\r\n\r\n\r\nPrecision and Parallelism: The DLAB pipette features a high-precision step motor that ensures accuracy and parallelism during pipetting, minimizing errors and improving data repeatability.\r\nErgonomic Design: Its lightweight streamlined design is ergonomically engineered to reduce fatigue and increase efficiency during extended use, ultimately enhancing the unit time of liquid transfer and experimental data reproducibility.\r\nRechargeable Battery: The DLAB pipette can be recharged via a desktop or power cord, providing users with the flexibility to choose the best charging method for their laboratory.\r\nProgrammable Volume Range: The DLAB pipette offers four programmable volume ranges: 0.5-10 µl, 5-50 µl, 15-300 µl, and 30-300 µl, allowing for a wide range of liquid transfer needs.\r\nUser-Friendly Interface: Its large', 0.00, 2900.00, NULL, NULL, 'https://maxmedme.com/storage/products/uBp97DU5Hg7WY6GZtwXWskwE0CaINvyd4yhGzmxB.png', 75, 7, NULL, 1, '\"[\\\"0.5-10\\\\u03bcL\\\",\\\"10-100\\\\u03bcL\\\",\\\"15-300\\\\u03bcL\\\",\\\"30-300\\\\u03bcL\\\"]\"', 'products/pdfs/Meh65b4VhhongKNnfeBd5ziD9crbaj2Um9lwAX6u.pdf', 1, '2025-05-03 18:55:55', '2025-06-16 02:44:05'),
(397, 'MM-0039', 'dPette+ Multi functional Electronic Pipette', 'dpette-multi-functional-electronic-pipette-mm-0039-dlab-dubai-uae', 'Motor driven digitally control pipette with multifunctions\r\nEasy Operations and Handling\r\nIntuitive menu interface settings: functions and operations\r\nMinimal force for pipetting operation\r\nHigh performance ensuring accuracy & repeatability\r\n2 buttons for all operational settings\r\nAdjustable speed for aspiration and dispensing\r\nLi-ion battery enable longer operation time\r\nConvenient and Versatile\r\nSelf-calibration applicable', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/V8RsaYL1CMJam5nP4lhUZl6l6aWiDinjsgIr4Whd.png', 75, 7, NULL, 1, '\"[\\\"0.5-10\\\\u03bcL\\\",\\\"5-50\\\\u03bcL\\\",\\\"30-300\\\\u03bcL\\\",\\\"100-1000\\\\u03bcL\\\"]\"', 'products/pdfs/OTfgo3VX4YMTDgIx3zsvhxWFF30X2oKi1EO9kayH.pdf', 1, '2025-05-03 19:14:43', '2025-06-15 22:06:36'),
(398, 'MM-0040', 'dPette Simple Electronic Pipette', 'dpette-simple-electronic-pipette-mm-0040-dlab-dubai-uae', 'The dPette is a single-channel electric pipette developed by DLAB that combines the advantages of both manual and electric pipettes. It has a lightweight and ergonomic design similar to a manual pipette, while also providing the high performance and effortless operation of an electric pipette, delivering a new and improved pipetting experience for laboratory users.\r\n\r\n\r\n\r\nPrecision and Parallelism: The dPette features a high-precision step motor that ensures accuracy and parallelism during pipetting, minimizing errors and improving data repeatability.\r\nRechargeable Battery: The dPette can be recharged via a desktop or power cord, providing users with the flexibility to choose the best charging method for their laboratory.\r\nProgrammable Volume Range: The dPette offers four programmable volume ranges: 0.5-10 µl, 5-50 µl, 30-300 µl, and 100-1000 µl, allowing for a wide range of liquid transfer needs.\r\nUser-Friendly Interface: Its large LCD screen provides a user-friendly interface that simulates manual pipetting operations and displays critical parameters, making it easy to use and set different functions.\r\nDual Rotary Knobs: The dPette features dual rotary knobs that enable all functions to be performed seamlessly, providing users with a simple and intuitive operation.\r\nAdjustable Speed: Users can adjust the aspiration and dispensing speeds to suit their specific requirements, enhancing the device\'s versatility.\r\nConvenient Mixing Function: The dPette provides a mixing function that is more convenient and effortless than a manual pipette.\r\nAutoclavable Components: The dPette features autoclavable components that allow users to sterilize the device at high temperatures and pressures.\r\nAutomatic Calibration: The dPette can be calibrated automatically by connecting it to a USB-enabled balance, eliminating the need to send the device for third-party calibration.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/7B9hAmd5j5nclLhoW6efN4srmrHdE6JPxqcdnB5j.png', 75, 7, NULL, 1, '\"[\\\"0.5-10\\\\u03bcL\\\",\\\"5-50\\\\u03bcL\\\",\\\"30-300\\\\u03bcL\\\",\\\"100-1000\\\\u03bcL\\\"]\"', 'products/pdfs/MprVnu6sWTXlJNKeOFwMh7BUHICkpWMiI8L6RFfD.pdf', 1, '2025-05-03 19:16:09', '2025-06-15 22:06:36'),
