(420, 'MW-0123', 'Glass Funnel', 'glass-funnel-mw-0123-maxware-dubai-uae', 'Funnel Machine Made Boro 3.3 Thin Thickness	    40ml 50ml 60ml 75ml 90ml 100ml\r\n\r\nSeparating Funnel Roundness Glass Stopcok/ Glass And Plastic Stopcok/PTEF Stopcock Glass Stopper/Plastic Stopper	    60ml 125ml 250ml 500ml 1000ml 2000ml\r\n\r\nSeparating Funnel Pyriform Glass Stopcok/ Glass And Plastic Stopcok/PTEF Stopcock Glass Stopper/Plastic Stopper	     60ml 125ml 250ml 500ml 1000ml 2000ml', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eGLEIirsc8QWZbC4eRwlPrnUiv28poTNzmRBlBWr.jpg', 75, 1, NULL, 1, '\"[\\\"40ml\\\",\\\"50ml\\\",\\\"60ml\\\",\\\"75ml\\\",\\\"90ml\\\",\\\"100ml\\\"]\"', NULL, 1, '2025-05-03 20:33:22', '2025-06-15 22:06:34'),
