(422, 'MT-0120', 'SARS-CoV-2 and Influenza A+B Antigen Combo Rapid Test', 'sars-cov-2-and-influenza-ab-antigen-combo-rapid-test-mt-0120-maxtest-dubai-uae', 'The SARS-CoV-2 and Influenza A+B Antigen Combo Rapid Test is a lateral flow immunoassay designed for the qualitative detection of nucleocapsid protein antigens from SARS-CoV-2, Influenza A, and Influenza B in human nasal swab specimens. This single-use test enables simultaneous screening for COVID-19 and influenza viruses, helping healthcare providers and individuals quickly differentiate between infections with overlapping symptoms.', 0.00, 250.00, NULL, NULL, 'https://maxmedme.com/storage/products/3IzePGyvwTTsdVY0HlZweXifU9zmzBDHZRdxirBI.png', 82, 2, NULL, 0, NULL, NULL, 1, '2025-06-14 14:02:16', '2025-06-15 22:06:36'),
(423, 'MT-0122', 'Melamine Rapid Test Kit', 'melamine-rapid-test-kit-mt-0122-maxtest-dubai-uae', 'Melamine is a common industry chemical, which was used illegally in milk to increase the protein content \r\nmeasured by classic Kjeldahl method. Milk products prepared from milk contaminated with melamine will directly \r\ndamage the urinary system, for instance, it will cause kidney stone in infant, whose main food is milk powder. FAO \r\nhas set a strict MRL to melamine in milk, other countries, such as China, USA also set MRLs. \r\nThis product utilizes the high affinity of monoclonal antibody against melamine, which can easily identify its \r\ncontamination in samples without any instrument. The detection limit of the kit is 30ppb.', 0.00, 872.00, NULL, NULL, 'https://maxmedme.com/storage/products/624Frw9mowb9z1A6uLwWUxyZz0LdffH1bFHCnAnt.png', 107, 2, NULL, 0, NULL, 'products/pdfs/CNKWK5n0w5EeZfKjonZO0sCtnYf9k2F6TnUkuGSj.pdf', 1, '2025-06-16 00:05:05', '2025-06-22 12:14:46'),
(424, 'MT-0121', 'Aflatoxin M1 Rapid Test Kit 0.05ppb', 'aflatoxin-m1-rapid-test-kit-005ppb-mt-0121-maxtest-dubai-uae', 'Aflatoxins are naturally occurring mycotoxins, which are extremely toxic and among the most carcinogenic \r\nsubstances known. After entering the animal body, aflatoxins may be metabolized by the liver t a new substance - \r\naflatoxin M1. Thus it is of great importance to monitor the residue of aflatoxin M1 in foods, especially in daily \r\nconsumptions, such as milk and many other dairy products. \r\nThis product utilizes the high affinity of monoclonal antibody against aflatoxin M1, which can easily identify its \r\ncontamination in milk without any instrument. The detection limit of the kit can meet both European and USA MRLs \r\nwhen use properly.', 0.00, 995.00, NULL, NULL, 'https://maxmedme.com/storage/products/BBdI7OI58kNMIblzz1RsyzDafq4JfX2nMDRkEQ7W.png', 107, 2, NULL, 0, NULL, 'products/pdfs/LGORIvzjbzKcvAm5czeUPslt9L34D6uOkzl5FfGX.pdf', 1, '2025-06-16 00:08:40', '2025-06-22 12:14:40'),
(425, 'MT-0123', 'ALP Rapid Test Strip', 'alp-rapid-test-strip-mt-0123-maxtest-dubai-uae', 'Alkaline Phosphatase (ALP) is an enzyme naturally present in all raw milks, which is used as\r\n an indicator of proper milk pasteurization. Complete pasteurization will inactivate the enzyme\r\n to below levels which are detectable by conventional methods. Because the heat stability of\r\n ALP is greater than that of pathogens which may be present in milk, the enzyme serves as an\r\n indicator of product safety. However, the failure to detect ALP activity does not guarantee that\r\n the product is pathogen free. The current ALP rapid test kit is based on chemical reaction of\r\n ALP with its substrate to detect ALP activity in pasteurized milk. It is specific and accurate.', 0.00, 385.00, NULL, NULL, 'https://maxmedme.com/storage/products/0s46AUNNIxTYTPdIzPcXFdBqorsN4KEcHtAltmkQ.png', 107, 2, NULL, 0, NULL, 'products/pdfs/tqwGJQwzJsCRYwAT5fVWlRNw0xpupbRggkWwf7aN.pdf', 1, '2025-06-16 00:09:31', '2025-06-23 10:18:57'),
(426, 'MW-0125', 'Bougie Endotracheal Introducer', 'bougie-endotracheal-introducer-mw-0125-maxware-dubai-uae', 'ET Tube Introducers (Bougies)\r\n\r\nSolid Type\r\n\r\nUsed for difficult intubation and tube exchange.\r\n\r\nUltra smooth surface reduces friction.\r\n\r\nAtraumatic tip helps minimize patient trauma.\r\n\r\nScale mark indicates distance to the tip.\r\n\r\nAvailable with or without an angled tip.', 0.00, 50.00, 20.00, NULL, 'https://maxmedme.com/storage/products/IuolNjdSwZmNeH5VRwRUYjBzpBfHujO9yytNmzKi.jpg', 110, 1, NULL, 1, '\"[\\\"6.0 Fr Solid Type\\\",\\\"10.0 Fr Solid Type\\\",\\\"15.0 Fr Solid Type\\\",\\\"10.0 Fr Hollow Type\\\",\\\"15.0 Fr Hollow Type\\\"]\"', NULL, 1, '2025-06-26 10:52:36', '2025-07-03 11:13:59'),
(427, 'MM-0047', 'ACQUITY UPLC H-Class QSM PM kit', 'acquity-uplc-h-class-qsm-pm-kit-mm-0047-waters-corporation-dubai-uae', 'The Waters™ Performance Maintenance Kit for the ACQUITY Quaternary Solvent Manager contains all the Waters Quality Parts™ necessary to keep your instrument operating at peak performance on an annual basis. The Waters™ Performance Maintenance Kit includes the following parts: mixer, plungers, check valves seals and filters.', 2900.00, 10730.00, NULL, NULL, 'https://maxmedme.com/storage/products/c9k0iday1c4yJMSbbFsoFmIqh2uKDnaMcgOyTDrZ.jpg', 109, 11, NULL, 0, NULL, NULL, 1, '2025-06-30 14:35:21', '2025-06-30 17:31:01'),
(428, 'MM-0048', 'ACQUITY UPLC H-Class SM-FTN PM Kit', 'acquity-uplc-h-class-sm-ftn-pm-kit-mm-0048-waters-corporation-dubai-uae', 'Comprehensive maintenance kit for the ACQUITY Tunable UV (TUV) and PDA detectors, including a long-life PerformancePLUS lamp and other certified parts. Designed for annual replacement to maintain detector sensitivity and stability', 3900.00, 14430.00, NULL, NULL, 'https://maxmedme.com/storage/products/IWeMjthHgPtSs1osZPE3IeV8sTP8famEAR48cId3.jpg', 109, 11, NULL, 0, NULL, NULL, 1, '2025-06-30 17:35:57', '2025-06-30 17:35:57'),
(429, 'MM-0049', 'ACQUITY TUV Performance Maintenance Kit', 'acquity-tuv-performance-maintenance-kit-mm-0049-waters-corporation-dubai-uae', 'The Waters Performance Maintenance Kit for the ACQUITY UPLC TUV/PDA contains all of the Waters Quality Parts necessary to keep your instrument operating at peak performance on an annual basis. It is used in ACQUITY UPLC PDA Detectors, ACQUITY eLambda PDA Detector, ACQUITY UPLC TUV Detectors, 2489 Dual Wavelength UV Detector and the 2998 PDA Detector. The old part number was 201000186. The Waters Performance Maintenance Kit includes the following parts: PerformancePLUS Long Life Lamp which is warranted for a lifetime of 2000 hours or 1 year, whichever comes first.', 1500.00, 5550.00, NULL, NULL, 'https://maxmedme.com/storage/products/hHaS9g7f8qJ43Wchrbab2gmqgAadwflMJ3nxP8qj.jpg', 109, 11, NULL, 0, NULL, NULL, 1, '2025-06-30 17:37:50', '2025-06-30 17:37:50'),
(430, 'MM-0050', 'ACQUITY Fluorescence Detector PM Kit', 'acquity-fluorescence-detector-pm-kit-mm-0050-waters-corporation-dubai-uae', 'The Waters Performance Maintenance Kit for the ACQUITY Fluorescence Detector contains all the Waters Quality Parts necessary to keep your instrument operating at peak performance on an annual basis. The Waters Performance Maintenance Kit includes the following parts: lamp.', 2300.00, 8510.00, NULL, NULL, 'https://maxmedme.com/storage/products/BK9yorqnST5HLxL6IgfsSgSXAz2O3mcyBzovJZll.jpg', 109, 11, NULL, 0, NULL, NULL, 1, '2025-06-30 17:39:31', '2025-06-30 17:39:31'),
(431, 'MM-0051', 'PL aquagel-OH 20', 'pl-aquagel-oh-20-mm-0051-agilent-technologies-dubai-uae', 'PL aquagel-OH columns offer efficient and reliable aqueous GPC/SEC separation of water-soluble polymers and large molecules, such as PEG, polysorbate, starch, dextran, and acrylamide. PL aquagel-OH columns meet USP L25, tolerate high buffer concentrations, pH 2 to 10, temperatures up to 90 °C, and organic solvents (up to 50% methanol).\r\n\r\nRapid and predictable scale-up of analytical SEC to milligram and gram quantities is easy with both analytical- and preparative-scale PL aquagel-OH columns. The analytical grade 8 µm media in PL aquagel-OH preparative columns provides higher separation speed and resolution, enabling precise cuts with high recovery and purity.\r\n\r\n\r\nEfficient and reliable size exclusion chromatography (SEC) column\r\nMeets USP L25, tolerates high buffer concentrations, pH range 2–10, temperatures up to 90 °C, and organic solvents (up to 50% methanol)\r\nVarious column configuration options provide tailored separations\r\nWell-tested resistance against interaction with neutral, multiply charged, polyanionic, and polycationic samples\r\nEasy scale-up to from analytical to preparative SEC\r\nHigh-resolution preparative 8 µm media gives faster runs, higher purity cuts, and better recovery than larger, broader distribution particles', 3120.00, 11544.00, NULL, NULL, 'https://maxmedme.com/storage/products/3aosXnfGYcMQAoLmiobOh5QjrqRB3iTpZFVJudV3.webp', 90, 12, NULL, 1, '\"[\\\"7.5mm x 300mm, 8 \\\\u00b5m\\\"]\"', NULL, 1, '2025-07-01 12:45:01', '2025-07-01 12:45:01'),
(432, 'MM-0052', 'Sugar KS-802', 'sugar-ks-802-mm-0052-shodex-dubai-uae', 'Column with sodium (Na+) counter ions\r\n\r\n• Only water is required for the analysis of neutral sugars\r\n\r\n• Can be used in combination (2-3 column in row with same or different exclusion limit)\r\n\r\n• Fulfill USP L22 and L58 requirements\r\n\r\n \r\n\r\nSUGAR KS-801 and SUGAR KS-802\r\n\r\nSeparates saccharides by combination of ligand exchange (Na+) and size exclusion modes\r\n\r\nOnly water is required for the analysis of neutral sugars\r\n\r\nExclusion limit 1,000 and 10,000\r\n\r\n​\r\n\r\nSUGAR KS-803 and SUGAR KS-804\r\n\r\nSuitable for separation of polysaccharides by size exclusion mode\r\n\r\nCan be used in combination with other columns e.g., SUGAR KS-802 and SUGAR KS-801\r\n\r\nExclusion limit 50,000 and 400,000', 2040.00, 7548.00, NULL, NULL, 'https://maxmedme.com/storage/products/mfZ4tc7lEULkCYzlZT5f5bMQhYT1xhrnqHE4BExH.jpg', 90, 13, NULL, 1, '\"[\\\"8.0mm x 300mm, 6 \\\\u00b5m\\\"]\"', NULL, 1, '2025-07-01 12:52:54', '2025-07-01 12:52:54'),
(433, 'MM-0053', 'Allure Organic Acids', 'allure-organic-acids-mm-0053-restek-dubai-uae', 'Allure Organic Acids columns provide enhanced retention and selectivity for polar organic acids. An Allure Organic Acids column effectively resolves key organic acids such as tartaric and quinic acids using the chromatographic conditions specified in AOAC method 986.13. Retention is stable and reproducible, even with the 100% aqueous mobile phase specified in the AOAC method.\r\n\r\nParticle: 5 µm, spherical\r\nPore Size: 60 Å\r\nCarbon Load: proprietary\r\nEnd-Cap: no\r\nSurface Area: 450 m2/g\r\npH Range: 2.5 to 8\r\nMaximum Temperature: 80 °C', 1320.00, 4884.00, NULL, NULL, 'https://maxmedme.com/storage/products/QPBVbAnhIIRu1gHJKFfsIWjoxWjAOhvJvNvk0LdW.jpg', 90, 14, NULL, 1, '\"[\\\"5 \\\\u00b5m, 250mm x 4.6mm\\\"]\"', NULL, 1, '2025-07-01 12:57:25', '2025-07-01 12:57:25'),
(434, 'MM-0054', 'S1315 M/C Ultra High Speed Camera 15,000fps@1280*1024', 's1315-mc-ultra-high-speed-camera-15000fps12801024-mm-0054-revealerhighspeed-dubai-uae', 'With higher bandwidth CMOS sensor, Large memory S series can achieve high-speed video recording, real-time acquisition.\r\n\r\nResolution: 1280x1024\r\nBit Depth: 10Bit\r\nFrame Rate:\r\n@1280*1024 15,000fps\r\n@1280x8 1,060,000fps\r\nRAM Storage: 192GB\r\n1TB/2TB/ 10TB/20TB(optional)\r\nUSB 3.0\r\nMini. Exposure Time: 100ns\r\nShutter: Global Shutter\r\nSupport ROI\r\nSupport uto Exposure\r\nSupport IRIG-B\r\nSize: 110x110x205mm\r\n(without lens) \r\nWeight: ≤3800g\r\n\r\n• Support ROI acquisition window setting, support\r\nresolution, frame rate linkage adjustment\r\n• Support auto exposure, EDR secondary exposure\r\n• Supports internal and external synchronization\r\n• Support rising edge, falling edge, low level, high level\r\nand other external signal triggering\r\n• Supports automatic triggering of image changes with a\r\n10x10 pixel area\r\n• Standard shutter release cable to control shooting and\r\nsaving, one-touch recording function\r\n• With automatic white balance, dark field correction,\r\nintelligent denoising, Gamma correction, color\r\noptimization module\r\n• SDI video output supports real-time screen preview and\r\nslow playback in the export preview state (select\r\nsettings)\r\n• Supports PIV cross-frame exposure for non-contact\r\nmeasurement of PIV, PTV, etc.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/kCzjJmS10k11NTwvPydZgrMJ8GPvRoGa5wveY6dU.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/JbtQObvcVfUgZ82PARyzYtjXSnSUb07nnQSWLHOh.pdf', 1, '2025-07-02 09:28:24', '2025-07-02 09:28:24'),
(435, 'MM-0055', 'M230 M/C Ultra High Speed Camera 3,000fps@1920×1080', 'm230-mc-ultra-high-speed-camera-3000fps19201080-mm-0055-revealerhighspeed-dubai-uae', 'The large memory and small size series high-speed camera is a miniature high-speed camera built by Revealer for experiments in various fields of science, enterprise research and development, fault location of equipment in industrial production lines, and observation of sea and air engineering, and it realizes terabyte-level mass storage through the comprehensive reconstruction of circuitry, structure, interfaces, appearance, and protection.\r\n\r\nSensor type: CMOS\r\nMax. Resolution: 1920×1080\r\nISO: 25000（M），8000（C）\r\nElectronic Shutter: Global Shutter\r\nMini. Exposure Time: 100ns\r\nSupport Automatic Exposure\r\nSupport Extreme Dynamic Range\r\nSSD Storage: 64GB/256GB/512GB/1TB/2TB\r\nLen Mount: F, C, EF: \r\nSize W*H*D Black: 75×75×97mm\r\nWhite: 98×98×98mm\r\nWeight: Black：≤820g White：≤1210g\r\n\r\nExtreme construction dimensions\r\nLarge memory, no data loss\r\nMovie grade quality\r\nSupport Offline use\r\nEDR double exposure\r\nB-code Alignment\r\nFlexible Lens Interface\r\nAnti-shock, anti-vibration, high and low temperature working conditions\r\nEfficient and easy-to-use RCC acquisition software', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/SCGIoEQ1KkfrfOj75pRMDnhEWJXYFkTFSJOAFVPS.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/v9HVcDZhkzdKpDJg2W6cin4nyv962y3c1FXNyopI.pdf', 1, '2025-07-02 09:30:43', '2025-07-02 09:30:43');
