(436, 'MM-0056', 'NEO25 M/C Ultra High Speed Camera 25,000fps@1280x1024', 'neo25-mc-ultra-high-speed-camera-25000fps1280x1024-mm-0056-revealerhighspeed-dubai-uae', 'High-sensitivity & ultra-high-speed camera utilizes a new generation of backside illumination sensors to enhance the capture efficiency of incident photons, enabling transient image capture within extremely short exposure times. This is suitable for ultra-high-speed applications.\r\n\r\nModel: NEO 25M/C\r\nSensor: BSI CMOS\r\nMax Resolution: 1280x1024\r\nFull Frame Rate: 25000fps\r\nShutter: Global Shutter\r\nMin Exposure Time: 150ns\r\nPIV Cross Frame: 250ns\r\nRAM: 320GB\r\nSupport Auto Exposure\r\nSupport EDR\r\nSupport Record Button\r\nData Interface: GigE/10GigE\r\nVideo Interface: SDI\r\nInput: 3.3/5V TTL\r\nOutput: 5V TTL\r\nTime Input Interface: DC IRIG B\r\nControl Interface: RS422 Reserved\r\nTrigger Input: Pulse trigger signal\r\nIO: I Output Interface Reserved, Customizable\r\nNEO 25M/C\r\nMount: F Port, C/EF Port Options\r\nWxHxD: ≤125x125x210mm\r\nNet Weight: ≤4200g\r\nThread: 1/4 NPT\r\nCooling: Fan cooling\r\n\r\nHigh-sensitivity\r\nEDR Secondary Exposure\r\nIntelligent Image Triggering\r\nIRIG-B Synchronization\r\nFlexible Lens Mount\r\nDual Power Supply\r\nEMC Protection\r\nFlexible for High & Low Temperature Working Environment\r\nEfficient & Easy-to-use Acquisition Software -- RCC', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/QWDFuK0iFMrxouZA9GEztabfT49HPgYBJwkba0x5.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/zsliNN9LughNrhhv7WAjM4dqyxyDP51TBFWvLWD4.pdf', 1, '2025-07-02 09:31:48', '2025-07-02 09:31:48'),
(437, 'MM-0057', 'G Pro High-Resolution High-Speed Camera 1,000fps@5120×4096', 'g-pro-high-resolution-high-speed-camera-1000fps51204096-mm-0057-revealerhighspeed-dubai-uae', 'High resolution G_Pro Series adopts APS-C format high speed global shutter CMOS image sensor, based on unique light pipe technology, with excellent shutter efficiency and angular response, realizing 21M pixel,4K resolution 1,000fps acquisition, can be applicated in large \r\nfield of view optical measurement, advertising field.\r\n\r\nG2110M/C_Pro\r\nSensor: CMOS\r\nDepth: 8/10（M）/12（M）Bit\r\nResolution: 5120×4096\r\nFrame: 1000fps\r\nMax. frame: 49100fps\r\nMin. exposure time: 1μs\r\nPIV: 300ns\r\nAE: Available\r\n\r\nG820M/C_Pro\r\nSensor: CMOS\r\nDepth: 8/10（M）/12（M）Bit\r\nResolution: 4096×2048\r\nFrame: 2000fps\r\nMax. frame: 49100fps\r\nMin. exposure time: 1μs\r\nPIV: 300ns\r\nAE: Available', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/JLvLdeNCH6r8GKs9ft56Zu7d2MJklEj6Uo1hFlOJ.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/nanD4DPigZsdcvmN6nd60TYHNZZDDPMrwPe46gkB.pdf', 1, '2025-07-02 09:33:08', '2025-07-02 09:33:08'),
(438, 'MM-0058', 'Gloria 4.2 sCMOS Extreme Low-Noise Scientific Camera', 'gloria-42-scmos-extreme-low-noise-scientific-camera-mm-0058-revealerhighspeed-dubai-uae', 'Revealer Gloria series sCMOs cameras are desiqned with Gpixel’s leading CMOS image sensor, combinedwith backside illumination technology and deep cooling sealing process for QE of up to 95% and extreme lownoise, suitable for life sciences, quantum physics, astronomical observation and semiconductor inspection andothers. lt’s compact design is suitable for integration into the SlM and other optical inspection systems.\r\n\r\nSKUs: Gloria 4.2\r\nSensor type andmodel: sCMOS GpixeI GSENSE2020BSI\r\nResolution: 2048 (H)x 2048 (V)\r\nPixel size: 6.5 μm x 6.5 μm\r\nEffective area: 13.3 mm x 13.3 mm\r\nFull well capacity: 45 000 e-\r\nReadout noise: 1.2 e- @ Low Noise Mode\r\nPeak QE: 95 % @ 560 nm\r\nDynamic range: 90 dB\r\nDSNU: 0.2 e-\r\nPRNU: <0.5%\r\nCooling: TEC, Air, Liquid, 45 °C below ambient temperature\r\nDark Current: Air: 0.5 e-/p/s @-10 °℃(typical); Liquid: 0.3 e-/p/s @-20 °℃ (typical)\r\nShutter: Rolling, Global reset\r\nBit depth: 11 bit & 12 bit & 16 bit\r\nFrame rate: USB : 61 fps @ 11 bit, 43 fps @ 12 bit46 fps @ 16 bit; CXP:135 fps @ 11 bit, 43 fps @ 12 bit,74 fps @ 16 bit\r\nReadout modes: Full format/Binning(2x2,4x4)/ROI\r\nExposure times: 5 us~ 10 s\r\nData interface: USB 3.1 Gen1, CoaXPress 2.0(CXP-12)\r\nTimestamp accuracy: 1 μs\r\nTrigger interface: SMA, TTL/ 3.3 V level signal\r\nOptical interface: C-mount\r\nPower supply: AC 100 ~ 240 V, 50 Hz/ 60 Hz,1 A\r\nPower consumption: 50 W\r\nSize: 84x84x125 mm\r\nWeight: 1300g\r\nOperating Environment: Temp0~40°C，RH10~80 %\r\nStorage Environment: Temp0~40°C，RH ≤90 %\r\nSDK: C，C#，C++，Python\r\nSoftware: RPC，Micro-manger，LabviewMatlab, Epics, ASCOM', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/gU2C8bH05dXeO9XKuAyH8moFPEjuxUGrz2E6yViC.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/squmxy0fsBM2HRy1Z2RvyCEelbMAqD88ZuJsc6Bl.pdf', 1,