(439, 'MM-0059', 'Digital Imaging Correlation (DIC) Measurement System', 'digital-imaging-correlation-dic-measurement-system-mm-0059-revealerhighspeed-dubai-uae', 'Based on non-contact optical measurement method, DIC strain measurement system measures the spatial three-dimensional coordinates of the object, displacement and strain data under load.\r\n\r\n\r\n\r\nProduct Line	SKU	Number of Cameras	Resolution	Frame Rate (fps)	Field of View (mm)	Displacement Accuracy	Strain Accuracy	Strain Range	Additional Features\r\nRDIC-HS	RDIC-HS-S	2	1280×800	16000	50~500	≤ 0.01pixel	≤ 100µε	0.005%~2000%	-\r\n	RDIC-HS-G_Pro	2	5120×4096	1000	10~1000	≤ 0.01pixel	≤ 50µε	0.005%~2000%	-\r\n	RDIC-HS-M	2	1920×1080	3000/2000/1000	50~500	≤ 0.01pixel	≤ 100µε	0.005%~2000%	-\r\nRDIC-EDU	RDIC-EDU	-	4096×3000 @30.5fps	30.5	200×150, 100×75	5μm (in-plane), 10μm (off-plane)	≤ 50µε	0.005%~2000%	Real-time image saving, tester communication\r\nRDIC-IR	RDIC-IR	2 (high-res), 1 (IR)	2448×2048 (visible), 640×512 (IR)	29 (visible), 25 (IR)	-	0.01pixel	≤ 50µε	0.005%~2000%	Temperature range: -20°C to +550°C (1500°C optional), NETD ≤ 50mk\r\nRDIC-STD	RDIC-STD-DH500	2	2448×2048	75	10~500	≤ 0.01pixel	≤ 100µε	0.005%~2000%	-\r\n	RDIC-STD-DH1200	2	4096×3000	30.5	10~1000	≤ 0.01pixel	≤ 50µε	0.005%~2000%	-\r\n	RDIC-STD-BM1200	2	4096×3000	29	10~1000	≤ 0.01pixel	≤ 50µε	0.005%~2000%	-\r\nRVE	RVE-EDU	-	1.3M	0~40	Micro~500	-	-	0.005%~500%	Supports Poisson\'s ratio, tester communication, accuracy class: ISO 9513 Class 0.5\r\n	RVE-STD	-	5M	0~40	Micro~1000	-	-	0.002%~1000%	Supports Poisson\'s ratio, tester communication, accuracy class: ISO 9513 Class 0.5\r\n	RVE-PRO	-	8M	0~40	Micro~1000	-	-	0.001%~2000%	Supports Poisson\'s ratio, tester communication, accuracy class: ISO 9513 Class 0.5', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9qOwgK3EoNY4ewURSHOzgtGzaHDCyTTFqUXIlFzn.jpg', 108, 16, 653, 0, NULL, 'products/pdfs/8Jk6dyXLEFKc3ufP3orL8A5McpstvLnw2WrLt6ym.pdf', 1, '2025-07-02 09:37:56', '2025-07-02 09:37:5