(440, 'MM-0060', 'NanoOne Microspectrophotometer', 'microspectrophotometer-mm-0060-yooning-dubai-uae', 'NanoOne-S a cost-effective UV/VIS spectrophotometer helps you access concentration of DNA, RNA, Protein quickly and accurately. NanoOne-S equipped with a long-life xenon lamp and a wavelength range of 180-910 nm and all data can be transferred by USB, widely used in molecular biology, clinical diagnostics, drug development, etc. NanoOne-S is an entry-level spectrophotometer with the most basic functions. Even on a tight budget, your lab can still have this instrument.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ATTXlpxp0TxWWMLIDOSM7Nj5oRO2vJBB6gxwJ65q.jpg', 111, 10, 649, 0, NULL, NULL, 1, '2025-07-02 11:57:28', '2025-07-03 07:31:39'),
(441, 'MM-0061', 'PC-32 Gradient thermal cycler', 'pc-32-gradient-thermal-cycler-mm-0061-yooning-dubai-uae', 'PC-32 gradient Thermal Cycler is a mini size designed for thermal cycling and protocol optimization in molecular biology, medical, food, genetic testing and etc.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ZmExDMKppbkSeitlxDrusbPpo4gazJh8QEI2swWH.jpg', 63, 10, 649, 0, NULL, 'products/pdfs/hP8fw4XKfSdJAMuxXihKSjN96afzuIje8VpzwIh0.pdf', 1, '2025-07-03 05:16:26', '2025-07-03 05:16:26'),
(442, 'MM-0062', 'PC-96 Gradient thermal cycler', 'pc-96-gradient-thermal-cycler-mm-0062-yooning-dubai-uae', 'The PC-96 is a cost-effective thermal cycler designed to deliver stable and uniform temperature control, even when working with a limited budget.\r\n\r\nEquipped with 6 Peltier modules forming 3 independent temperature zones, it ensures excellent temperature accuracy and uniformity across all 96 wells. The instrument features dual side air outlets and two powerful heating fans, enabling rapid and efficient cooling.\r\n\r\nWith a user-friendly touchscreen interface and a stylus pen for precise operation, the PC-96 is easy to use. It supports a temperature gradient of up to 42°C, making it ideal for touch-down PCR and long-time PCR protocols.\r\n\r\nWhether you\'re running standard amplification or optimizing reaction conditions, the PC-96 is a reliable partner in your molecular biology workflow.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/axUbdx6xEyoxcbBswTQ2thmbA95JlmlscVXDZ370.jpg', 63, 10, 649, 0, NULL, 'products/pdfs/wGG3M1JBkMMIy9LZ1nSo5bcYVsxkwBI2GtQNHt86.pdf', 1, '2025-07-03 06:38:13', '2025-07-03 07:32:16'),
(443, 'MM-0063', 'PC-96P Gradient thermal cycler', 'pc-96p-gradient-thermal-cycler-mm-0063-yooning-dubai-uae', 'PC-96P is an upgraded generation of PC-96 gradient thermal cycler. Built with advanced Peltier technology, it delivers precise temperature control and outstanding durability. This makes it an ideal choice for life science research in a wide range of laboratories.\r\nFeatures:\r\n• 6 high precise peltiers\r\n• Good temperature uniformity reduce edge effect\r\n• Peltier based technology, max heating up rate 6℃ /sec\r\n• 1024x768 pixel, 8 -inch color touch screen Automatically power failure recovery \r\n• Gradient range 42℃\r\n• Small footprint, compact design\r\n• One-touch rapid incubation function to meet the needs of experiments such as denaturation, enzyme digestion/ligation, and ELISA.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/MvEhWi7LmqXIPrXXszjGm0y1iHYlVnCTRyq2xudN.jpg', 63, 10, 649, 0, NULL, 'products/pdfs/owdX7Q9xmg9zSB88HkGraprl7lygN9SEInDced3v.pdf', 1, '2025-07-03 09:42:33', '2025-07-03 09:42:33'),
(444, 'MM-0064', 'T200 Gradient thermal cycler', 't200-gradient-thermal-cycler-mm-0064-yooning-dubai-uae', 'T200 is a qualitative thermal cycler with dual blocks which are independent controlled, the advanced peltier technology brings accurate temperature control, and make the cycles reaches up to a million times. It’s an ideal thermal cycler for researches of life sciences in most labs.\r\nFeatures:\r\n• 6 high precise peltiers\r\n• Two independent controlled blocks\r\n• Good temperature uniformity reduce edge effect\r\n• Peltier based technology, max heating up rate 6℃ /sec\r\n• 1024x768 pixel, 8 -inch color touch screen Automatically power failure recovery \r\n• Gradient range 30℃\r\n• Small footprint, compact design\r\n• One-touch rapid incubation function to meet the needs of experiments such as denaturation, enzyme digestion/ligation, and ELISA.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/sskvWX36bXaQhnfpKCgJWbs4sGf2Cvvxp0jkXOHO.jpg', 63, 10, 649, 0, NULL, 'products/pdfs/74MSYPyZ7YbN9LlT34LAASe4JznlUtsY3XIpOtHu.pdf', 1, '2025-07-03 09:45:39', '2025-07-03 09:45:39'),
(445, 'MM-0065', 'MiniC-100 Mini Dry Bath Incubator', 'minic-100-mini-dry-bath-incubator-mm-0065-yooning-dubai-uae', 'Mini Dry Bath Incubator is controlled by PID, applied to vehicle power supply due to small palm-size and light weight. Widely used in rapid inspection kit or small labs\r\nModels:\r\n• MiniC-100, -10 ~100℃, ≤30min ( R.T.-20℃ @R.T.25℃)\r\n\r\nOPTIONAL ACCESSORIES:\r\n• M1 block mini dry bath incubator,0.2ml x 32\r\n• M2 Block mini dry bath incubator,0.5mi x 24\r\n• M3 Block mini dry bath incubator,1.5ml x 15\r\n• M4 Block mini dry bath incubator,2.0ml x 15\r\n• M5 Block mini dry bath incubator,cuvette  x 8\r\n• M6 Block mini dry bath incubator,15 ml x 6 centrifuge tube( can\'t close the lid)\r\n• M7 Block  mini dry bath incubator,50ml x 2 centrifuge tube( can\'t close the lid)\r\n• M8 Block  mini dry bath incubator,5ml x 12 centrifuge tube( can\'t close the lid)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/gZ3uexe0tX0JkeWMjdFemwKu604EO3wfR3DwcZ6f.jpg', 73, 10, 649, 0, NULL, 'products/pdfs/vYqbedy8of3RhpWaCE8ZmDd9wfhVUM1KNq4dKUIt.pdf', 1, '2025-07-03 10:15:28', '2025-07-03 10:15:28'),
(446, 'MM-0066', 'WH-10 Water Bath', 'wh-10-water-bath-mm-0066-yooning-dubai-uae', 'Water Bath is a multi-function thermostat water tank controlled by PID. It’s an indispensable tool in the fields of pharmaceutical, biochemistry, scientific research, environmental protection and etc.\r\n\r\nMODEL:\r\nWH-2\r\nWH-5\r\nWH-10', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9eJMloiKMeltGiEA9Vy0JzuGo1Tn7EOlseDcfwL8.jpg', 73, 10, 649, 0, NULL, 'products/pdfs/t1JbdcwuTPB8dZ6t5pGn4nbmIB86feglVD0ti5vN.pdf', 1, '2025-07-03 10:25:10', '2025-07-03 10:25:10'),
(447, 'MW-0126', 'securement device for an Endotracheal Tube (ETT)', 'securement-device-for-an-endotracheal-tubeett-mw-0126-maxware-dubai-uae', 'A specialized medical device designed to reliably secure endotracheal tubes in place during intubation and mechanical ventilation. This securement system minimizes the risk of tube displacement, accidental extubation, and associated complications—enhancing both patient safety and clinician confidence in critical care and surgical settings.', 0.00, 15.00, 8.00, 0.00, 'https://maxmedme.com/storage/products/d9MBrccWvDoxOHfrt0BqhsVXtZhH9XxhnhKddYXj.jpg', 110, 1, NULL, 0, NULL, NULL, 1, '2025-07-03 11:13:37', '2025-07-03 11:19:21'),
(448, 'MM-0067', 'NanoAccu Microspectrophotometer', 'nanoaccu-microspectrophotometer-mm-0067-yooning-dubai-uae', 'NanoAccu is the upgraded version of our NanoOne microspectrophotometer, designed to meet higher performance demands in molecular biology and microbiology research.\r\nNanoAccu also features automatic calibration for reliable results—users can follow simple on-screen instructions to complete the calibration. High repeatability, high stability, and optional multi-level user access control make it an ideal all-in-one microspectrophotometer for advanced research labs.\r\n\r\nFeatures:\r\n• New intuitive UI, with easy navigation and more measurement methods\r\n• Custom mode can improve measure time based on sample concentration range \r\n• Broader absorbance range up to 750 Abs, 5 path lengths enabling accurate detection of higher concentration samples\r\n• OD600 cuvette with stirring and heating functions, ideal for microbial growth kinetics studies\r\n• Option for Three-level Audit trail & Contamination analysis(optional), helping ensure sample purity\r\n• Long life’s Xenon flash lamp.\r\n• Only 0.5～2μl sample volume requested, which can be recycled after test, ideal for precious samples. \r\n• Built-in printer.\r\n• Measurement result can be exported to U disk in format of Excel, JPG.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/B18TQwZBYiA6BzbFPP5Cgk2rLU3wokakMe2vH5FY.jpg', 111, 10, 649, 0, NULL, 'products/pdfs/0R7vq7Qdi3wrQDdbuDuBhxOgSUznBlYo67En7tso.pdf', 1, '2025-07-03 11:27:55', '2025-07-03 11:27:55'),
(449, 'MM-0068', 'Zorbax Bonus-RP (Reversed Phase) RR (Rapid Resolution)', 'zorbax-bonus-rp-reversed-phase-rr-rapid-resolution-mm-0068-agilent-technologies-dubai-uae', 'Reversed-Phase UHPLC Column for Polar Analytes\r\n\r\nThe ZORBAX Bonus-RP RR column features an embedded amide linkage within a C14-alkyl chain, offering enhanced selectivity for polar compounds and excellent performance in 100% aqueous mobile phases. Designed for Rapid Resolution High Definition (RRHD) applications, this column utilizes 1.8 µm fully porous silica particles, delivering exceptional peak shapes and high efficiency—even for challenging analytes.', 1470.00, 5439.00, 3885.00, 1050.00, 'https://maxmedme.com/storage/products/Lev33R7ECqev8r6RL3fkcb2zX48dX1ysSfczXWJY.webp', 90, 12, NULL, 1, '\"[\\\"2.1 x 100mm, 1.8\\\\u202f\\\\u00b5m\\\"]\"', NULL, 1, '2025-07-04 11:38:48', '2025-07-04 12:20:31'),
(450, 'MM-0069', 'Kato Katz Test Kit', 'kato-katz-test-kit-mm-0069-ecalbio-dubai-uae', 'Kato Katz Test Kit , is also called Parasite ovum test kit, is using the Kato Katz method to detect ascaris ova, hookworm ovum, liver fluke eggs, etc.\r\nDetermining parasite ovum with the Kato-Katz method is recognized recommendation method by WHO.\r\nTo detect parasite eggs in feces, the detection cartridge for microscopy can improve the effect of the parasite and can be analyzed to  detect the degree of infection.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/IOGLnzlwzSrFVUg81pwCTRkNbrzJhQlvtlnGeIVN.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:06:28', '2025-07-05 12:07:59'),
(451, 'MM-0070', 'DNA Purification Kit', 'dna-purification-kit-mm-0070-ecalbio-dubai-uae', 'DNA Purification Kit is used to purify total genomic DNA from a variety of sample sources including fresh or frozen animal tissues and cells, blood, or bacteria. Sample extraction filter genomic DNA spin column and the DNA adsorbs to the Spin column membrane in the presence of high concentrations of chaotropic salt. Genomic DNA is purified from the DNA spin column through the elution and centrifugation. All purification process requires no phenol or chloroform extraction, or alcohol precipitation, and involves minimal handling.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/rzJV7SVwpa84Dx3LAtQxcY3tP7ZiA2bHiOFx27E1.jpg', 63, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:10:17', '2025-07-05 12:10:17'),
(452, 'MM-0071', 'RNA Purification Kit', 'rna-purification-kit-mm-0071-ecalbio-dubai-uae', 'RNA Purification Kit is a simple and efficient system for purification of RNA from cultured cells, tissue, human blood cells, bacteria, yeast and virus. Samples are lysed by Lysis Buffer, mix with ethanol and transfer to spin column, RNA to bind to the silica membrane while the lysate is spun through the column, take pure RNA through centrifugation, washing process under RNase free conditions.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/w9A7kEtmIQPzFX5sC9iuwwK3pqBwup0PjbjXY7Hu.jpg', 63, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:11:15', '2025-07-05 12:11:15'),
(453, 'MM-0072', 'DNA/RNA Purification Kit', 'dnarna-purification-kit-mm-0072-ecalbio-dubai-uae', 'DNA Purification Kit is used to purify genomic DNA and total RNA from a single cell and tissue sample. The unique lysate can dissociate cells and inactivate cellular RNA/DNA enzymes to release DNA and RNA complex. RNA is released through filtering genomic DNA-Free spin column and the DNA adsorbs to the Spin column membrane in the presence of high concentrations of chaotropic salt. Genomic DNA is purified from the DNA spin column based on the elution and centrifugation. RNA was selectively adsorbed on the RNA-Free spin column under high disordered salt, is purified through the elution and centrifugation process.\r\nPurified genomic DNA is eluted in low-salt buffer or water, is highly suited for PCR, qPCR, dPCR, NGS, Southern blotting, RAPD, AFLP, and RFLP applications.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/5BKIkVXWua0eEiLMfTAMm1Z68igvUtswnFGrKBov.jpg', 63, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:12:40', '2025-07-05 12:12:40'),
(454, 'MM-0073', 'AflatoxinB1 Standard Substance', 'aflatoxinb1-standard-substance-mm-0073-ecalbio-dubai-uae', 'The qualitative analysis for principal component of the material is obtained by liquid chromatography-mass spectrometry (LC-MS), ultraviolet and visible spectroscopy (UV-VIS) and nuclear magnetic resonance (NMR). The certified value (purity of AflatoxinB1) is based on the results of mass balance method and qNMR method. Structure related impurities are determined by liquid chromatography - tandem mass spectrometry (LC-MS/MS). Moisture content, inorganic impurities and volatile organic compounds are measured by Karl Fischer, ICP-MS and GC-FID respectively. Based on the above results, the purity certification value is given.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/N8qP1GNCnAs1z3HxaItofl4kwIPMc29iU7dqhnlO.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:14:48', '2025-07-05 12:14:48'),
(455, 'MM-0074', 'Aflatoxin Total in Acetonitrile', 'aflatoxin-total-in-acetonitrile-mm-0074-ecalbio-dubai-uae', 'Aflatoxin B1/ 1162-65-8,  Aflatoxin B2/ 7220-81-7,  Aflatoxin G1/1165-39-5,  Aflatoxin G2/7241-98-7 \r\n\r\nResult concentration:  \r\nAflatoxin B1: 1.00±0.01μg/mL,   \r\nAflatoxin B2: 1.00±0.01μg/mL,\r\nAflatoxin G1: 1.00±0.01μg/mL,   \r\nAflatoxin G2: 1.00±0.03μg/mL\r\n\r\nStarting material:  Aflatoxin B1, lot#A24407P, ECALBIO CO.,LTD,  \r\nAflatoxin B2, lot#A24407P, ECALBIO CO.,LTD,\r\nAflatoxin G1,lot#A24407P,ECALBIO CO.,LTD, \r\nAflatoxin G2,lot#A24407P,ECALBIO CO.,LTD.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/q44WXPqHk5mthfIcWRRni3IX4sKndvVf4SJP13ox.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:16:21', '2025-07-05 12:16:21'),
(456, 'MM-0075', 'Deoxynivalenol Standard Substance', 'deoxynivalenol-standard-substance-mm-0075-ecalbio-dubai-uae', 'The qualitative analysis for principal component of the material is obtained by liquid chromatography-mass spectrometry (LC-MS), ultraviolet and visible spectroscopy (UV-VIS) and nuclear magnetic resonance (NMR). The certified value (purity of Deoxynivalenol) is based on the results of mass balance method and qNMR method. Structure related impurities are determined by liquid chromatography - tandem mass spectrometry (LC-MS/MS). Moisture content, inorganic impurities and volatile organic compounds are measured by Karl Fischer, ICP-MS and GC-FID respectively. Based on the above results, the purity certification value is given.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/dGKCQVmyzofWfy2A8MzCijYyMC69TkD3zWeWlKG7.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:17:54', '2025-07-05 12:17:54'),
(457, 'MM-0076', 'Ochratoxin A Standard Substance', 'ochratoxin-a-standard-substance-mm-0076-ecalbio-dubai-uae', 'The qualitative analysis for principal component of the material is obtained by liquid chromatography-mass spectrometry (LC-MS), ultraviolet and visible spectroscopy (UV-VIS) and nuclear magnetic resonance (NMR). The certified value (purity of Ochratoxin A) is based on the results of mass balance method and qNMR method. Structure related impurities are determined by liquid chromatography - tandem mass spectrometry (LC-MS/MS). Moisture content, inorganic impurities and volatile organic compounds are measured by Karl Fischer, ICP-MS and GC-FID respectively. Based on the above results, the purity certification value is given.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/1ykiBl869cU1gzCR2WwZGFgbcUb1zTnNA2iTyKhz.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:22:12', '2025-07-05 12:22:12'),
(458, 'MM-0077', 'Microcystin-LR Standard Substance', 'microcystin-lr-standard-substance-mm-0077-ecalbio-dubai-uae', 'The qualitative analysis for principal component of the material is obtained by liquid chromatography-mass spectrometry (LC-MS), ultraviolet and visible spectroscopy (UV-VIS) and nuclear magnetic resonance (NMR). The certified value (purity of Microcystin-LR) is based on the results of mass balance method and qNMR method. Structure related impurities are determined by liquid chromatography - tandem mass spectrometry (LC-MS/MS). Moisture content, inorganic impurities and volatile organic compounds are measured by Karl Fischer, ICP-MS and GC-FID respectively. Based on the above results, the purity certification value is given.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9u0sdI2cgMRD2gTX5GECILvi3xTwTrRS0flTMXsf.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:23:02', '2025-07-05 12:23:02'),
(459, 'MM-0078', 'Prestained Protein Ladder', 'prestained-protein-ladder-mm-0078-ecalbio-dubai-uae', 'Prestained Protein Ladder is a prestained mixture of ten recombinant proteins ranging from 10 kDa to 180 kDa. Three different chromophores are bound to the proteins, producing a brightly colored ladder. The protein ladder is conveniently packaged and ready to use with no heating, diluting or additional reducing agent necessary. Lot-to-lot variation of the apparent molecular weight of prestained proteins is ~5 %.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eula7JbrNy8OUa2EDAz244J6c0ld2y0NmV1biPwC.jpg', 63, 17, 658, 0, NULL, 'products/pdfs/v3pEctUQTYuddFZCVFbO56cRdNDGecjX35o7liOU.pdf', 1, '2025-07-05 12:25:33', '2025-07-05 12:25:33'),
(460, 'MM-0079', 'SuperLumia ECL Plus HRP Substrate Kit', 'superlumia-ecl-plus-hrp-substrate-kit-mm-0079-ecalbio-dubai-uae', 'SuperLumia ECL Plus HRP Substrate Kit is a highly sensitive, nonradioactive, enhanced luminol-based chemiluminescent substrate for easy detection of horseradish peroxidase (HRP) on immunoblots. The ECL Western Blotting Substrate offers superior signal and clear background. Blots can be repeatedly exposed to X-ray film to obtain optimal results or stripped of the immunodetection reagents and re-probed. The special formulation of ECALBIO SuperLumia ECL Plus HRP Substrate makes it the ideal substitute for Pierce ECL Western Blotting Substrate without the need for additional optimization of assay conditions.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/reWAqtryuo4pnyOVM15AszmY7eadWXJEcSxtssL0.jpg', 76, 17, 658, 0, NULL, 'products/pdfs/n064zoHkyxsdkBRc0C3VxQPRBeNf0oXrjIf5fYbE.pdf', 1, '2025-07-05 12:28:50', '2025-07-05 12:28:50'),
(461, 'MM-0080', 'SYBR Green/SYBR Premix Ex Taq Kit', 'sybr-greensybrpremix-ex-taq-kit-mm-0080-ecalbio-dubai-uae', 'SYBR Premix Ex Taq Kit is used for intercalator based real time PCR using SYBR®Green. Rapid reaction mixtures are based on a 2×concentration premixed with SYBR®Green I at a concentration appropriate for real time monitoring.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/5pxyvbB5rPjzA6csf6vuJtQpKa3VcYgEf27KRLC1.jpg', 76, 17, 658, 0, NULL, 'products/pdfs/0idzbtjHibEC60nkqP5slbM8TLqDFI2GnbuGLKVc.pdf', 1, '2025-07-05 12:31:04', '2025-07-05 12:31:04'),
(462, 'MM-0081', 'Benzopyrene Rapid Test Kit', 'benzopyrene-rapid-test-kit-mm-0081-ecalbio-dubai-uae', 'Benzopyrene rapid test kit is based on lateral flow immunochromatographic assay to detect Benzopyrene in the oil, tissue sample.\r\nThe test device has a testing window. The testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the sample hole on the device, the liquid will laterally flow on the surface of the test strip.The Test card yields a positive result and T zone is invisible if Benzopyrene in the sample exceed the detect limit. \r\n\r\nRapid Test Card     	 40 PCS\r\nSample Extraction	   2* 50 mL', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/C0Zxm1WWvzNMDvxNSr0phCfVtQC9iaMvHxh1B3rK.jpg', 86, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:36:40', '2025-07-05 12:36:40'),
(463, 'MM-0082', 'Nicotine Rapid Test Kit', 'nicotine-rapid-test-kit-mm-0082-ecalbio-dubai-uae', 'Nicotine rapid test kit is based on lateral flow immunochromatographic assay to detect Nicotine in the Nicotiana tabacum, serum and tissue sample.\r\nThe test device has a testing window. The testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the sample hole on the device, the liquid will laterally flow on the surface of the test strip.The Test card yields a positive result and T zone is invisible if Nicotine in the sample exceed the detect limit.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/OfMjco9VU3gCBNBatcML7kGfQobOMG7b9uciYLNO.jpg', 86, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:38:40', '2025-07-05 12:38:40'),
(464, 'MM-0083', 'Total Aflatoxins Test Card', 'total-aflatoxins-test-card-mm-0083-ecalbio-dubai-uae', 'Total Aflatoxins test card is based on lateral flow immunochromatographic assay. The test device has a testing window. The testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the sample hole on the device, the liquid will laterally flow on the surface of the test strip. If there is little AflatoxinB1 in the sample, a visible T band will appear; T band is invisible if it has more AflatoxinB1 in the sample. The C band should always appear after a sample is applied, indicating a valid result. By this means, the device can accurately indicate the presence of Aflatoxins in the Edible oil ,feed, corn,grains.\r\n\r\nDetect limit： 5ppb (µg/kg)', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/nRuB6zNl3YsG9owCL392xI4dxX27SHeoqYElBo5A.jpg', 86, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:40:06', '2025-07-05 12:40:06'),
(465, 'MM-0084', 'AflatoxinB1 Test Card', 'aflatoxinb1-test-card-mm-0084-ecalbio-dubai-uae', 'AflatoxinB1 test card is based on lateral flow immunochromatographic assay. The test device has a testing window. The testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the sample hole on the device, the liquid will laterally flow on the surface of the test strip. If there is little AflatoxinB1 in the sample, a visible T band will appear; T band is invisible if it has more AflatoxinB1 in the sample. The C band should always appear after a sample is applied, indicating a valid result. By this means, the device can accurately indicate the presence of AflatoxinB1 in the Edible oil ,feed,corn,wheat,grains.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/6vDxc3sYa5lN2ONbO6QNQ6bzFDapVcezOQ0vKeYx.jpg', 86, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:40:43', '2025-07-05 12:40:43'),
(466, 'MM-0085', 'Capsaicin Rapid Test Kit', 'capsaicin-rapid-test-kit-mm-0085-ecalbio-dubai-uae', 'Capsaicin rapid test kit is based on lateral flow immunochromatographic assay to detect Capsaicin in the oil,tissue sample.\r\nThe test device has a testing window. The testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the sample hole on the device, the liquid will laterally flow on the surface of the test strip. The Test card yields a positive result and T zone is invisible if Capsaicin in the sample exceed the detect limit. \r\n\r\nDetect limit： 5.0 ppb', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/JZzVzqpqomNBVm8jueSUg4nwSOje1iJoPQlcKy7G.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 12:42:15', '2025-07-05 12:42:15'),
(467, 'MM-0086', 'Aflatoxin M1 Immunoaffinity Column', 'aflatoxin-m1-immunoaffinity-column-mm-0086-ecalbio-dubai-uae', 'A simple and efficient extraction and purification procedure for Aflatoxins was developed by means of the immunoaffinity column (IAC-SEP ® AFLA M1) as a cleanup tool．This method do not use toxic solvents such as chloroform and methylene chloride. AflatoxinM1 content in milk, fermented milk, powder, infant formula powder, cheese and cream samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast, simple, safe and highly accurate method for quantitatively measuring aflatoxin M1.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/v3bFZUTVzxgjxJQ0EX43jpPyHPOhoXUHc8GUSAZY.png', 112, 17, 658, 0, NULL, 'products/pdfs/Pnw5OMNwfSeJ9qVT0LpPzZniWQaUgLpRxoa6f95C.pdf', 1, '2025-07-05 13:29:17', '2025-07-05 13:29:17'),
(468, 'MM-0087', 'AflatoxinB1 Immunoaffinity Column', 'aflatoxinb1-immunoaffinity-column-mm-0087-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Aflatoxin was developed by means of the immunoaffinity column (IAC-SEP®AFLA-B1) as a cleanup tool．AflatoxinB1 content in Grain, Food, Feeds, Nuts, Peanuts, Soy sauce, Vinegar, Chili, Pepper, Medicinal herbs and Wine samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast, simple, safe and highly accurate method for quantitatively measuring aflatoxin-B1.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/fgBu8uoibFK4cMhc3pnMiFMqlFZ9aui8RV2QaJLn.png', 112, 17, 658, 0, NULL, 'products/pdfs/xsJt1obzio7Fu4kcgUoEPWa4uXecisy7uKzCsRu1.pdf', 1, '2025-07-05 13:30:35', '2025-07-05 13:30:35'),
(469, 'MM-0088', 'Aflatoxins Immunoaffinity Column', 'aflatoxins-immunoaffinity-column-mm-0088-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Aflatoxins was developed by means of the immunoaffinity column (IAC-SEP® AFLA) as a cleanup tool．Aflatoxins content in Grain, Food, Feeds, Nuts, Peanuts, Soy sauce, Vinegar, Chili, Pepper, Medicinal herbs and Wine samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast, simple, safe and highly accurate method for quantitatively measuring aflatoxins(B1,B2,G1,G2).', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/dR2et5rzV4gYWFCcOmK3QUhkfBbETi269AIyQG3K.png', 112, 17, 658, 0, NULL, 'products/pdfs/F22vh96tIMF8Ree4vKwzxZsrhvLyfTS8BPlkpOf2.pdf', 1, '2025-07-05 13:32:14', '2025-07-05 13:32:14'),
(470, 'MM-0089', 'Zearalenone Immunoaffinity Column', 'zearalenone-immunoaffinity-column-mm-0089-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Zearalenones was developed by means of the immunoaffinity column (IAC-SEP® ZEN) as a cleanup tool. Zearalenones content in grain feed are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast,simple, safe and highly accurate method for quantitatively measuring Zearalenones.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/GbfsWGLIdh4SXiMbYNA0uAej1zGIa4P2nbVVG9xY.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/pB1JFk5HRcgonOPwelIv3taerrDr9qlx8nhWX1XA.pdf', 1, '2025-07-05 13:33:48', '2025-07-05 13:33:48'),
(471, 'MM-0090', 'Fumonisins Immunoaffinity Column', 'fumonisins-immunoaffinity-column-mm-0090-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Fumonisins was developed by means of the immunoaffinity column (IAC-SEP®Fumo) as a cleanup tool．Fumonisins content in Rice, Corn, Wheat, Nuts, Spices, Peanuts Peanuts products, Vegetable oil, Feed samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast,simple, safe and highly accurate method for quantitatively measuring FumonisinB1,B2,B3.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/1TSuEAfPbWX4dia8jGCbGc8XhwGSuPBlMvP18tmR.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/UjjZppnKae0llhNR8qQJh8c5AOWKdUmVDIvMr71a.pdf', 1, '2025-07-05 13:35:27', '2025-07-05 13:35:27'),
(472, 'MM-0091', 'T-2 toxin Immunoaffinity Column', 't-2-toxin-immunoaffinity-column-mm-0091-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for T-2 toxin was developed by means of the immunoaffinity column (IAC-SEP® T-2) as a cleanup tool．T-2 toxin content in grain, food, feed, nuts, peanuts, soy sauce, vinegar, chili, pepper, medicinal herbs and wine samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast,simple, safe and highly accurate method for quantitatively measuring T-2 toxin.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/CzWqVMArpPn0N0MUlluXQsJtN8VEI2qXsoX7VqLw.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/VbUfsN3kWP95wKeytdolQuVhglhzl5VPA0Cxh5A3.pdf', 1, '2025-07-05 13:37:56', '2025-07-05 13:37:56'),
(473, 'MM-0092', 'Citrinin Immunoaffinity Column', 'citrinin-immunoaffinity-column-mm-0092-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Citrinin was developed by means of the immunoaffinity column (IAC-SEP® IAC-CIT) as a cleanup tool．Citrinin content in Kogi Red Rice, Rice, Corn and Chili samples are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast, simple, safe and highly accurate method for quantitatively measuring Citrinin.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/LIKq7MFkrdHjXA811I65BcA9Ovdrh8xq50GB4m1k.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/drQUcRbh013fYQJzhYcjkyqdOp5oglvB9QY63wUY.pdf', 1, '2025-07-05 13:39:11', '2025-07-05 13:39:11'),
(474, 'MM-0093', 'Deoxynivalenol Immunoaffinity column', 'deoxynivalenol-immunoaffinity-column-mm-0093-ecalbio-coltd-dubai-uae', 'A simple and efficient extraction and purification procedure for Deoxynivalenol was developed by means of the immunoaffinity column (IAC-SEP ® DON) as a cleanup tool．Deoxynivalenol content in corn, wheat, oats, barley, rice, and other grains are cleaned up by IAC and determined by HPLC or LC-MS/MS. It is a fast, simple, safe and highly accurate method for quantitatively measuring DON.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/4WBmhHzPziIA4C6TjnEREX4ww34uTndBVb4gE2lt.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/Re2L0PnQftiEkZY7a2iXTtnh01gzdT5j6GHmkeXk.pdf', 1, '2025-07-05 13:40:51', '2025-07-05 13:40:51'),
(475, 'MM-0094', 'Ochratoxin A Immunoaffinity Column', 'ochratoxin-a-immunoaffinity-column-mm-0094-ecalbio-coltd-dubai-uae', 'To measure Ochratoxin levels, samples are prepared by mixing with an extraction solution, followed by blending and filtering. The extract is then applied to the Ochratoxin A column, which contains specific antibodies for Ochratoxin A. At this stage, the ochratoxin binds to the antibody on the column. The column is then washed to rid the immunoaffinity column of impurities. By passing methanol through the column, the ochratoxin is removed from the antibody. The methanol can then be injected into an HPLC or LC-MS system.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/7zBwdpRrEbxKI8k7W9Skc6l98t2Q3EihWVq9QWql.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/p87GpFCDKN2YAtoeACcuiu7uLtpK7XUBrV4YdfYM.pdf', 1, '2025-07-05 13:42:14', '2025-07-05 13:42:14'),
(476, 'MM-0095', 'Tobacco Mosaic Virus Rapid Test Kit', 'tobacco-mosaic-virus-rapid-test-kit-mm-0095-ecalbio-coltd-dubai-uae', 'Tobacco Mosaic Virus (TMV) Rapid Test Kit is based on lateral flow immunochromatographic assay to detect Tobacco Mosaic Virus content in the Tobacco leaf or tissue sample.\r\n\r\nDetect limit： 10 ppb            \r\nSpecification： 40 tests/kit\r\nDetect time:  30 min', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9jjkiG0j4B2r28lCToDq2JXe0yfcx3LdQcW43qmU.jpg', 86, 17, 658, 0, NULL, 'products/pdfs/mkiHCaqKt66xBJH9zGDsDhEf8kdalwJ4J0dBmZWY.pdf', 1, '2025-07-05 13:44:12', '2025-07-05 13:44:12'),
(477, 'MM-0096', 'Halal Food Test Kit', 'halal-food-test-kit-mm-0096-ecalbio-coltd-dubai-uae', 'Halal Food Test Kit rapid test kit is using lateral flow immunoassay to detect pork ingredients in the meat or food sample.\r\nThe testing window has an invisible T (test) zone and C (control) zone. When sample is applied into the test zone on the device, the liquid will laterally flow on the surface of the test strip. For a valid test，the card yields a positive result if Pork in the sample.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9ZHAw2LDtvIstCxANZdnUSpPcmzFdDZgBPLA4Ufm.jpg', 107, 17, 658, 0, NULL, 'products/pdfs/9rp3bTLjQDEvBjqEI8Z8UalmbnL6w13Fn0wD7zKW.pdf', 1, '2025-07-05 13:46:25', '2025-07-05 13:46:25'),
(478, 'MM-0097', 'Acetamiprid ELISA Kit', 'acetamiprid-elisa-kit-mm-0097-ecalbio-coltd-dubai-uae', 'Acetamiprid ELISA kit is a competitive enzyme immunoassay for the quantitative analysis of Acetamiprid in the fruit, plant isolate, vegetable and tea samples. \r\nThe coupling antigens are coated on the micro-well stripes. The Acetamiprid in the sample and the coupling antigens coated on the micro-well stripes compete for the anti-Acetamiprid antibodies. After the addition of the enzyme conjugate, the TMB substrate is added for coloration.\r\nThe optical density (OD) value of the sample has a negative correlation with the Acetamiprid in it. The measurement is made photometrically at 450nm. The absorption is inversely proportional to the Acetamiprid concentration in the sample.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/oLzDQIQJlNaVCQM87Q39Z2Z3tmZ7oTL2n6uxPOTC.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 13:48:26', '2025-07-05 13:48:26'),
