(484, 'MM-0103', 'Thiamethoxam ELISA Kit', 'thiamethoxam-elisa-kit-mm-0103-ecalbio-coltd-dubai-uae', 'Thiamethoxam ELISA kit is a competitive enzyme immunoassay for the quantitative analysis of Thiamethoxam in the fruit, plant isolate, vegetable and tea samples. \r\nThe coupling antigens are coated on the micro-well stripes. The Thiamethoxam in the sample and the coupling antigens coated on the micro-well stripes compete for the anti-Thiamethoxam antibodies. After the addition of the enzyme conjugate, the TMB substrate is added for coloration.\r\nThe optical density (OD) value of the sample has a negative correlation with the Thiamethoxam in it. The measurement is made photometrically at 450nm. The absorption is inversely proportional to the Thiamethoxam concentration in the sample.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/oS3Ep7b1YkzzPkUAAHyMMmBB3tVWdnAPZNn54tN2.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 13:53:09', '2025-07-05 13:53:09'),
(485, 'MM-0104', 'Monkey Pox Virus qPCR Kit', 'monkey-pox-virus-qpcr-kit-mm-0104-ecalbio-coltd-dubai-uae', 'The Monkeypox Virus Detection Kit (Fluorescence PCR Method) is a qualitative in vitro real-time PCR test for the detection of nucleic acid from monkeypox virus (MPV) in the oropharyngeal swab, nasopharyngeal swab, serum, plasma, and human pustular or vesicular rash specimens from individuals suspected of MPV infection. \r\nResults are for the identification of MPV DNA. Positive results are indicative of the presence of MPV DNA; clinical correlation with patient history and other diagnostic information is necessary to determine patient infection status. Positive results do not rule out bacterial infection or co-infection with other viruses. \r\nNegative results do not preclude MPV infection and should not be used as the sole basis for patient management decisions. Negative results must be combined with clinical observations, patient history, and epidemiological information. \r\nThe Monkeypox Virus Detection Kit (Fluorescence PCR Method) is intended for use by qualified and trained clinical laboratory personnel specifically instructed and trained in the techniques of real-time PCR and in vitro diagnostic procedures.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/mPxSg7PWN3LtgRXkBzP3athMvDbQrca8mHhXUQLb.jpg', 63, 17, 658, 0, NULL, NULL, 1, '2025-07-05 19:11:05', '2025-07-05 19:11:05'),
(486, 'MM-0105', 'ATP Swabs', 'atp-swabs-mm-0105-ecalbio-coltd-dubai-uae', 'The Surface ATP Swab is a stand-alone device for use with a handheld ATP biofluorescence detector. It is used to monitor thesanitary conditions on the surfaces of processing units and various other industrial environments. The system works by measuring adenosine triphosphate (ATP), an energy molecule commonly found in the cells of all animals, plants, bacteria, yeast and molds. ATP is contained in organic products left on surfaces. microbial contamination of surfaces contains ATP, but usually in small amounts. After proper cleaning, it should be possible to substantially reduce all sources of ATP. After a sample is collected and exposed to the unique liquid stabilized luciferase/luciferin reagent in the surface ATP detection swab device, the light emitted is proportional to the amount of ATP present in the sample. the ATP detector measures the light produced and reports the result in relative luminescence intensity units (RLU). the RLU result provides information on the level of contamination within seconds. a higher RLU number indicates that more ATP is present The higher the number, the dirtier the surface. It is important to note that the ATP detection swab is designed to detect invisible/trace residues. If a visibly dirty surface is wiped, the swab will be overloaded with material that will subsequently inhibit the bioluminescence response, resulting in inaccurate results. For liquid samples, liquid ATP assay swabs are used, contact your salesperson for details.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/OLe4Fkz7ItCO8vAU6Utf2ou3MDTYh1OVqrq8A5AQ.jpg', 112, 17, 658, 0, NULL, NULL, 1, '2025-07-05 19:15:52', '2025-07-05 19:17:50');
