(487, 'MM-0106', 'Portable ATP System', 'portable-atp-system-mm-0106-ecalbio-coltd-dubai-uae', 'Built on advanced photodiode sensor, Portable ATP luminometer is sensitive and ease of use.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/LSpRSdFQlXdrJVsCl8hmRYDigobcGql1m3YDGijh.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/ODTU7Pd1KfHsnxPRzbKEQdSeWQ8pRmZnDkmf1rOR.pdf', 1, '2025-07-05 19:23:44', '2025-07-05 19:23:44'),
(488, 'MM-0107', 'LB Broth Medium', 'lb-broth-medium-mm-0107-ecalbio-coltd-dubai-uae', 'LB Broth Medium is composed of tryptone, yeast extract and NaCI，is  configurable as 1L liquid of LB Broth Medium.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ZuRaqzBdkhxqx5bjFFl4szN7IuUQpHE4mQbGMAfG.png', 76, 17, 658, 0, NULL, 'products/pdfs/n3SFjiIQriec4oi74vz2il8iHYDSH3tPHiB0wVSd.pdf', 1, '2025-07-05 19:35:07', '2025-07-05 19:35:07'),
(489, 'MM-0108', 'Disposable Sampling Tube', 'disposablesamplingtube-mm-0108-ecalbio-coltd-dubai-uae', 'For liquid, powder, solid sampling and storage.\r\nAseptic, high temperature resistance, acid and alkali resistance, corrosion resistance.\r\nTransparent, with scale, good sealing.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/J6ND77ywdKJV7VUBnq0TLSuaYyIh7VzXjAPCX1Bf.jpg', 112, 17, 658, 0, NULL, 'products/pdfs/BLr8QrnoWQNMdIVDDl93IFXfuvCjFQt9oxX0IFti.pdf', 1, '2025-07-05 19:44:22', '2025-07-05 19:44:22'),
(490, 'MM-0109', 'Murashige Skoog (MS) Basal Medium', 'murashige-skoog-ms-basal-medium-mm-0109-ecalbio-coltd-dubai-uae', 'ECALBIO produce MS-Medium very popular standard materials which is used for a wide range of plant species. Contains macroelements, microelements and vitamins such as described by MURASHIGE & SKOOG.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/tW80EowMDSBheuV90LJ80i4wCSNoONfPV6yMmC3d.png', 76, 17, 658, 0, NULL, 'products/pdfs/r0OQ2ONc78OpZ5Dow3a0fHnmUGrndPmM3Ib76n9G.pdf', 1, '2025-07-05 19:51:37', '2025-07-05 19:51:37'),
(491, 'MM-0110', 'Microcystins ELISA Kit', 'microcystins-elisa-kit-mm-0110-ecalbio-coltd-dubai-uae', 'Microcystins ELISA test kit is based on is a competitive enzyme immunoassay for the quantitative detection of Microcystin toxin in surface water samples, with an assay quantitative range from 0.0625 to 1 parts per billion (ppb).\r\n(See the Appendix at the end of this package insert describing an alternate assay protocol, suitable for use with colorless and/or potable water samples, with a quantitative range from 0.0625 to 1.0ppb.)\r\n• Quantitative laboratory detection of Microcystin toxin surface water.\r\n• Cross Reaction :with MC-LR，MC-RR，MC-YR.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/BwsaBzHZ8KubGoXtzYiyQlzrJ0Yvu75ULMEHfYpH.jpg', 63, 17, 658, 0, NULL, NULL, 1, '2025-07-05 19:56:52', '2025-07-05 19:56:52'),
(492, 'MM-0111', 'Benzopyrene ELISA Kit', 'benzopyrene-elisa-kit-mm-0111-ecalbio-coltd-dubai-uae', 'This test kit is based on the competitive enzyme immunoassay for the detection of  Benzopyrene in the rapeseed oil, soybean oil, peanut oil, corn oil, blended oil, etc. The coupling antigens are pre-coated on the micro-well stripes. The Benzopyrene in the sample and the coupling antigens pre-coated on the micro-well stripes compete for the anti-Gen antibodies. After the addition of the enzyme conjugate, the TMB substrate is added for coloration. The optical density (OD) value of the sample has a negative correlation with Benzopyrene concentration in the sample. This value is compared to the standard curve and the content of the corresponding Benzopyrene is subsequently obtained.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/rmXwTNCNnlmRDdSW4pp9FR2kDLdNRrukz0gpCcYS.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 19:58:32', '2025-07-05 19:58:32'),
(493, 'MM-0112', 'Total Aflatoxins ELISA Kit', 'total-aflatoxins-elisa-kit-mm-0112-ecalbio-coltd-dubai-uae', 'Total Aflatoxins ELISA Test Kit is a competitive enzyme immunoassay for the quantitative analysis of Aflatoxin B1,B2,G1,G2,M1,M2 in cereal grains and feed , etc.\r\n\r\n Sensitivity : 0.025ppb     \r\nDetect time: Approx. 75 min\r\n Detection limit:\r\n Grains...........................2.0ppb\r\n Feed.............................1.0ppb\r\n Oil................................ 2.0ppb\r\n Milk..............................0.5ppb', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eQKI5cAaDxRYzyRUgNiR4oz7VKJHCntV5FIPIYPh.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 19:59:46', '2025-07-05 19:59:46'),
(494, 'MM-0113', 'Gossypol  ELISA  Kit', 'gossypol-elisa-kit-mm-0113-ecalbio-coltd-dubai-uae', 'Gossypol ELISA kit is a competitive enzyme immunoassay for the quantitative analysis of gossypol in the cottonseed, cotton meal, extruded cotton, cotton isolate, cotton concentrated samples.\r\n\r\nSensitivity: 0.50ppm       \r\nDetect time: Approx.75 min', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/z8uJdrFx2nXw7JpY5HaTOd0xt4R1391WW5bfQBI5.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 20:00:38', '2025-07-05 20:00:38'),
(495, 'MM-0114', 'Tenuazonic Acid ELISA Kit', 'tenuazonic-acid-elisa-kit-mm-0114-ecalbio-coltd-dubai-uae', 'Tenuazonic Acid(TA) ELISA Test Kit is a competitive enzyme immunoassay for the quantitative analysis of Alternariol in cereal grains and feed , etc.\r\n\r\n Sensitivity : 1.0ppb     \r\nDetect time: Approx. 75 min\r\n Detection limit:\r\n Grains...........................2.0ppb\r\n Feed.............................1.0ppb\r\n Milk..............................0.5ppb', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/ImVT3dDK22uNrf7d9AlXOCLhzX2R8NVwLBXP5r85.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 20:01:45', '2025-07-05 20:01:45'),
(496, 'MM-0115', 'Alternariol ELISA Kit', 'alternariol-elisa-kit-mm-0115-ecalbio-coltd-dubai-uae', 'Alternariol ELISA Test Kit is a competitive enzyme immunoassay for the quantitative analysis of Alternariol in cereal grains and feed , etc.\r\n\r\n Sensitivity : 1.0ppb    \r\n Detect time: Approx. 75 min', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/krBLyhNqstvUGVKLSwW6FHqK7hDwRbjGEGGA6zke.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 20:04:38', '2025-07-05 20:04:38'),
(497, 'MM-0116', 'Capsaicin ELISA Kit', 'capsaicin-elisa-kit-mm-0116-ecalbio-coltd-dubai-uae', 'This test kit is a competitive ELISA for the quantitative analysis of Capsaicin in the rapeseed oil, soybean oil, peanut oil, corn oil, blended oil, etc. The coupling antigens are pre-coated on the micro-well stripes. The Capsaicin in the sample and the coupling antigens pre-coated on the micro-well stripes compete for the anti-Cap antibodies. After the addition of the enzyme conjugate, the TMB substrate is added for coloration. The optical density (OD) value of the sample has a negative correlation with Capsaicin concentration in the sample. This value is compared to the standard curve and the content of the corresponding Capsaicin is subsequently obtained. \r\n\r\nSensitivity : 1ppb     \r\nDetect time: Approx. 30 min', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/3u90qW42Le96BxoTjQ6LuqJ74dyzBBfvk2he51Kw.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 20:05:49', '2025-07-05 20:05:49'),
(498, 'MM-0117', 'Transgene Cry1Ab/Ac ELISA Kit', 'transgene-cry1abac-elisa-kit-mm-0117-ecalbio-coltd-dubai-uae', 'Transgene Cry1Ab/Ac ELISA Kit is a competitive enzyme immunoassay for the quantitative analysis of Transgene Cry1Ab/Ac soybean, wheat, corn, rice with extruded material, protein isolate samples. \r\nAn antibody with a affinity for Cry1Ab/Ac is coated onto microwells. Standard or sample is added to the appropiate well and if Cry1Ab/Ac is present it will bind to the coated antibody. Subsequently, Cry1Ab/Ac bound to horse-radish peroxidase (HRP) is added and binds to the antibody not already occupied by Cry1Ab/Ac present in the sample or standard. After this incubation period, the contents of the wells are decanted, washed and an HRP substrate is added which develops a blue color in the present of an enzyme. The resulting color intensity, has an inverse relationship with the target concentration in the sample. The levels of Cry1Ab/Ac in the sample are determined by comparison of the color intensity of unknown samples with the standard curve, which is made using the Cry1Ab/Ac standards provided in the kit.\r\nCry1Ab/Ac ELISA Kit incorporates a fast, low-cost sample prep protocol with high recovery rates.\r\n\r\nSensitivity :  0.10 ppb\r\nSpecification:  96 tests /kit', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/yQ9nf1nAZaesH7LTbbRmCGkdL6oMC843hNj1769j.jpg', 76, 17, 658, 0, NULL, NULL, 1, '2025-07-05 20:07:29', '2025-07-05 20:07:29'),
(499, 'MM-0118', 'UV-Vis spectrophotometer', 'uv-vis-spectrophotometer-mm-0118-ecalbio-coltd-dubai-uae', '1.The host can independently accomplish photometric measurement and    quantitative  measurement,spectral  scanning,dynamics,DNA/protein  test, wavelength testing and data printing function,etc.\r\n2.Using the latest ARM system,built-in double operating system in both     Chinese and English,can through the USB interface transfer data storage.\r\n\r\nFeatures:\r\n1.Adopt 1200 bar/mm high-performance grating.New new light control system makes the instrument light switch more quickly.\r\n2.The instrument adopts 320*240 lattice highlighted LCD display,direct display scan map,the screen interface simple,convenient use.\r\n3.Socket xenon lamp and tungsten lamp design,after change light no need optical debugging\r\n4.Large sample chamber,Can accommodate 5-100mm various specifications of the cuvette\r\n5.Can be directly connected to the printer to print patterns and the experimental data\r\n6.Optional disk automatic 8 joint cuvettes holder.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/U79HyMXUxqCMuGVQX3sUZc768Aa590XnyXHjpeqR.jpg', 64, 17, 658, 0, NULL, NULL, 1, '2025-07-06 14:08:55', '2025-07-06 15:05:21'),
(500, 'MM-0119', '0.01mg balance', '001mg-balance-mm-0119-ecalbio-coltd-dubai-uae', 'Features:\r\n● Black backlit 120*55 mm LCD screen\r\n● Electromagnetic balance sensor\r\n● External/ Internal calibration\r\n● 4-level shockproof\r\n● Counting function\r\n● Supports PC connection. Wireless bluetooth printin', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/9DKkr1yprsfWiLwJFNeRZQmf2tpwZrTOrORolmPH.png', 116, 17, 658, 0, NULL, NULL, 1, '2025-07-06 14:15:22', '2025-07-06 15:04:55'),
(501, 'MM-0120', 'Water Analyzer', 'water-analyzer-mm-0120-ecalbio-coltd-dubai-uae', 'Blank calibration,automatic measurement, direct reading of concentration.\r\nWith built -in standard curve.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/KeQA3c52eBOByQwM55gH94nc8DmOqvimJwgPo0JV.jpg', 115, 17, 658, 0, NULL, NULL, 1, '2025-07-06 14:28:55', '2025-07-06 15:04:48'),
(502, 'MM-0121', 'Mobile Water Aanalyzer', 'mobile-water-aanalyzer-mm-0121-ecalbio-coltd-dubai-uae', 'Blank calibration,automatic measurement, direct reading of concentration.\r\nWith built -in standard curve.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/EUdmir6UeDo8949jgl4GJcW66FL3AUDIT3Jd3bS0.png', 114, 17, 658, 0, NULL, NULL, 1, '2025-07-06 14:30:44', '2025-07-06 15:04:39'),
(503, 'MM-0122', 'ACE 3 AQ', 'ace-3-aq-mm-0122-ace-dubai-uae', 'ACE® AQ columns provide great reproducibility and column lifetime. These stainless steel columns are available in a wide range of particle sizes and dimensions from capillary to preparative.\r\n\r\nUltra high purity, base deactivated silica with exceptional reproducibility\r\nRetains polar compounds in 100% aqueous mobile phase\r\nUnique C18 bonded phase with integral polar functionality\r\nIdeal for use with fast gradients due to its rapid re-equilibration properties and resistance to retention loss\r\nWide range of particle sizes (2 to 10 µm) and complementary phases\r\nMethod validation kits contain three different batches of the same phase - available on request\r\n\r\nThese columns are designed for a wide range of chromatographic applications, to provide great performance with acidic, basic and neutral molecules.', 630.00, 2331.00, 1665.00, 450.00, 'https://maxmedme.com/storage/products/tKnZuAQ9xsV49wGqV10keiDyevJ09Y4qDVeoOZnj.webp', 90, 19, NULL, 1, '\"[\\\"3.0 \\\\u00d7 150 mm\\\"]\"', NULL, 1, '2025-07-07 10:53:21', '2025-07-07 10:53:21'),
(504, 'MM-0123', 'Capripox Antibodies ELISA Kit', 'capripox-antibodies-elisa-kit-mm-0123-wuhan-ecalbio-co-ltd-dubai-uae', 'This kit has been developed for the detection of serum antibody to Capripox virus and applicable to the Capripox immune antibody detection, diagnosis and epidemiological investigation.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/q4sNFZzCJ46tnLvUEND7cM9sGwxG8EP25cKMaogD.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:11:12', '2025-07-08 18:11:12'),
(505, 'MM-0124', 'Bovine Tuberculosis Virus Antibody ELISA Kit', 'bovine-tuberculosis-virus-antibody-elisa-kit-mm-0124-wuhan-ecalbio-co-ltd-dubai-uae', 'Bovine Tuberculosis (TB) is a serious bacterial disease caused by mycobacterium bovis that affects the respiratory system. Bovine TB, capable of infecting most mammals including humans, is a chronic disease that has affected animal health throughout recorded history.\r\nThe Bovine TB antibody ELISA is an indirect Enzyme Linked Immunosorbent Assay for the qualitative detection of bovine tuberculosis antibody in serum.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/nJjoOJUxePq6CtPVNRs9wwcOgS0MStw5BPZmfuK9.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:12:08', '2025-07-08 18:12:08'),
(506, 'MM-0125', 'The Bovine Tuberculosis Antibody Rapid Test Kit', 'the-bovine-tuberculosis-antibody-rapid-test-kit-mm-0125-wuhan-ecalbio-co-ltd-dubai-uae', 'INTENDED USE\r\nThe Bovine Tuberculosis Antibody Rapid Test is a lateral flow immunochromatographic assay for the qualitative detection of Bovine Tuberculosis Antibody (BTB Ab) in cattle\'s serum, plasma. \r\n\r\nPRINCIPLE\r\nThe Bovine Tuberculosis Antibody Rapid Test is based on sandwich lateral flow immunochromatographic assay. The test device has a testing window for the observation of assay running and result reading. The testing window has an invisible T (test) zone and a C (control) zone before running the assay. When the treated sample was applied into the sample hole on the device, the liquid will laterally flow through the surface of the test strip and react with the pre-coated Tuberculosis antigens. If there are anti-TB antibodies in the specimen, a visible T line will appears. The C line should always appear after a sample is applied, which indicates a valid result. By this means, the device can accurately indicate the presence of Bovine Tuberculosis antibodies in the specimen.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/Il2nWT4Kq35UVtH2D5E9Vi3JO8MnC4uUd8qhNpmn.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:14:20', '2025-07-08 18:14:20'),
(507, 'MM-0126', 'Bovine Rotavirus Rapid Test Kit', 'bovine-rotavirus-rapid-test-kit-mm-0126-wuhan-ecalbio-co-ltd-dubai-uae', 'INTENDED USE\r\nBovine Rotavirus is a lateral flow immunochromatographic assay for the qualitative detection of Bovine Rotavirus antigen in the serum, plasma or blood. \r\n\r\nPRINCIPLE\r\nThe Bovine Rotavirus Rapid Test is based on sandwich lateral flow immunochromatographic assay. The test device has a testing window for the observation of assay running and result reading. The testing window has an invisible T (test) zone and a C (control) zone before running the assay. When the treated sample was applied into the sample hole on the device, the liquid will laterally flow through the surface of the test strip and react with the pre-coated Rotavirus antibodies. If there are anti-Rotavirus antigens in the specimen, a visible T line will appears. The C line should always appear after a sample is applied, which indicates a valid result. By this means, the device can accurately indicate the presence of Bovine Rotavirus in the specimen.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/RgXNlAVjeE8bNv1IFo0CYJHfYALwUM78RFozIO0l.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:15:25', '2025-07-08 18:15:25'),
(508, 'MM-0127', 'Bovine Coronavirus Rapid Test Kit', 'bovine-coronavirus-rapid-test-kit-mm-0127-wuhan-ecalbio-co-ltd-dubai-uae', 'INTENDED USE\r\nBovine coronavirus is a lateral flow immunochromatographic assay for the qualitative detection of Bovine Bovine coronavirus antigen in the serum, plasma or blood. \r\n\r\nPRINCIPLE\r\nThe IBR Antibody Rapid Test is based on sandwich lateral flow immunochromatographic assay. The test device has a testing window for the observation of assay running and result reading. The testing window has an invisible T (test) zone and a C (control) zone before running the assay. When the treated sample was applied into the sample hole on the device, the liquid will laterally flow through the surface of the test strip and react with the pre-coated coronavirus antibodies. If there are coronavirus in the specimen, a visible T line will appears. The C line should always appear after a sample is applied, which indicates a valid result. By this means, the device can accurately indicate the presence of Bovine coronavirus in the specimen.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/AIstzLemvElGYpMXiPeJgvxU7UhwPEIXAjMGM3Y3.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:16:09', '2025-07-08 18:16:09'),
(509, 'MM-0128', 'The Bovine Tuberculosis Antibody Rapid Test Kit', 'the-bovine-tuberculosis-antibody-rapid-test-kit-mm-0128-wuhan-ecalbio-co-ltd-dubai-uae', 'INTENDED USE\r\nThe Bovine Tuberculosis Antibody Rapid Test is a lateral flow immunochromatographic assay for the qualitative detection of Bovine Tuberculosis Antibody (BTB Ab) in cattle\'s serum, plasma. \r\n\r\nPRINCIPLE\r\nThe Bovine Tuberculosis Antibody Rapid Test is based on sandwich lateral flow immunochromatographic assay. The test device has a testing window for the observation of assay running and result reading. The testing window has an invisible T (test) zone and a C (control) zone before running the assay. When the treated sample was applied into the sample hole on the device, the liquid will laterally flow through the surface of the test strip and react with the pre-coated Tuberculosis antigens. If there are anti-TB antibodies in the specimen, a visible T line will appears. The C line should always appear after a sample is applied, which indicates a valid result. By this means, the device can accurately indicate the presence of Bovine Tuberculosis antibodies in the specimen.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/GATvMhLLdldiCK5JstWRWUW52XSGRfL2moIckgtr.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:17:14', '2025-07-08 18:17:14'),
(510, 'MM-0129', 'Human Echinococcosis（Hydatidosis）Rapid test kit', 'human-echinococcosishydatidosisrapid-test-kit-mm-0129-wuhan-ecalbio-co-ltd-dubai-uae', 'Human echinococcosis (hydatidosis, or hydatid disease) is caused by the larval stages of cestodes (tapeworms) of the genus Echinococcus.  Echinococcus granulosus causes cystic echinococcosis, the form most frequently encountered; E. multilocularis causes alveolar echinococcosis; E. vogeli causes polycystic echinococcosis; and E. oligarthrus is an extremely rare cause of human echinococcosis.\r\n\r\nRapid in Vitro Diagnostic Kit For Human Echinococcosis (DIGFA)，also called Echinococcosis Rapid test kit , is an immunochromatographic assay for the qualitative detection of total Echinococcosis antibodies in the serum from human, can be used for identification of Echinococcosis field infection of human. Principle This rapid test is coated with four kinds of Cystic and alveolar echinococcosis antigens ( EgCF, Egp, EgB, Em2) in the NC membrane of the card, which become complex antibodies coated membrane attached onto water absorption materials. When add the samples, immunoassay card and wash buffer step by step they can rise chemical response with the antibodies, those over doses seep into the water absorption materials and turn to form colloidal gold compound. Therefore the membrane presents red spots for positive results, while no spots appear for negative results. It is the percolating principle that used to determine the four types of Echinococcosis antibodies in the human serum.', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/eDgR8u0E2U7MdEKBOOgXPTyG17z1qmPLBFF6vsb7.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:18:03', '2025-07-08 18:18:03'),
(511, 'MM-0130', 'Bovine Early Pregnancy Rapid Test', 'bovine-early-pregnancy-rapid-test-mm-0130-wuhan-ecalbio-co-ltd-dubai-uae', 'Summary \r\nThis reagent is based on the principle of colloidal gold immunochromatographic assay (GICA) and isused for the detection of pregnancy-associated glycoproteins (PAGs) in bovine serum samples. The sample is added to the spiking wells and moved along the chromatographic membrane with the colloidal gold marker.    \r\nIf pregnancy-associated glycoproteins (PAGs) are present in the sample, they bind to colloidal gold markers   and antibodies on the test line and show a purplish-red color, while no color reaction occurs if the amount of  pregnancy-associated glycoproteins (PAGs) in the sample is below the detection threshold.\r\n\r\nSpecification: 40 tests /kit', 0.00, 0.00, NULL, NULL, 'https://maxmedme.com/storage/products/VmVbDuaj5PUPS5pyApv7bzLd1Sd4aZ2PZyimtUns.jpg', 93, 17, 658, 0, NULL, NULL, 1, '2025-07-08 18:18:44', '2025-07-08 18:18:44');
