(426, 649, 'Hangzhou Yooning Instrument Co.,Ltd', 10, '91330105MA27YUNU6R', '91330105MA27YUNU6R', '91330105MA27YUNU6R', '4 floor, #6 Building, No.4 Jiuqugang Road, Yuhang District, Hangzhou, China', 'Hangzhou', 'Zhejiang', '311112', 'China', '+86 147 9671 6542', NULL, NULL, 'https://www.yooning.com/', 'Ethan', 'info2@yooning.com', '+86 147 9671 6542', 'Hangzhou, China', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 30, 'AED', NULL, 7, NULL, NULL, '[\"Lab Equipment - Mixing & Shaking Equipment/Thermal Equipment/Analytical Instruments\", \"Molecular & Clinical Diagnostics - PCR\"]', '[]', 'Yooning Instrument is an ISO9001 certified high-tech enterprise specializing in R&D, production, sales and service of laboratory instruments and life science instruments, located in Hangzhou City, Zhejiang China.\r\nOur main products are Dry Bath Incubator (block heater), Centrifuge, Mixer, Shaker, Micro-Spectrophotometer, PCR and etc., which are commonly used in scientific research labs, medical industry, environment, food safety and so on.\r\nYooning has strong distributor network not only in our domestic market, but also overseas countries like Japan, Singapore, Indonesia, India, Italy, Germany, UK, Turkey, Argentina, Brazil, the USA, ect. Yooning are becoming more and more popular due to good quality and excellent aftersales service.', 10, NULL, 5.00, 0, 100.00, 5.00, NULL, 'pending_approval', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30 12:19:52', '2025-07-02 09:40:25', '{\"trade_license_file\": \"hangzhou_yooning_instrument_coltd/trade_license_file/f6h2reWnnBcpaAeAixPMEKVcLHrlbMwjFgG9lsaS.pdf\", \"company_profile_file\": \"hangzhou_yooning_instrument_coltd/company_profile_file/O55v2teeN5NeDXKdcFp6BdIFJ0n06qB2SHMDUnUx.pdf\"}', 1, '2025-07-02 09:40:25'),
(429, 653, 'HF Agile Dvice', 16, 'HF Agile Dvice', NULL, '91340100570434353J', 'Fuhuang New Vision Building, No. 77, Wutaishan Road, Baohe Economic Development Zone, Hefei City', 'Hefei', 'China', '430074', 'China', '008617702727158', NULL, NULL, 'https://www.revealerhighspeed.com/', 'Lin Chen', 'chenlin@revealerhighspeed.com', '008617702727158', 'Overseas Sales Manager', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 30, 'AED', NULL, 7, NULL, NULL, '[\"Ultra High Speed Camera;\", \"Ultra High Resolution Camera;\", \"sCMOS Scientific Camera;\", \"Digital Imaging Correlation (DIC);\", \"Particle Imaging Velocimetry (PIV).\"]', NULL, 'HF Agile Device Co., Ltd., founded in 2011, is the leading scientific instrument company dedicated to innovation in high-speed visual perception and measurement technology in China mainland. The brand name is Revealer®.\r\n\r\nHF Agile Device has developed optoelectronic measuring instruments and measurement analysis systems including High Speed Camera, DIC, PIV, and sCMOS Scientific Camera, with extensive applications in various sectors by more than 5,000 users.', 2011, NULL, 5.00, 0, 100.00, 5.00, NULL, 'pending_approval', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-07-01 12:51:58', '2025-07-01 13:02:14', '{\"trade_license_file\": \"hf_agile_dvice/trade_license_file/ksQIVHk8qWZTPD4iY5hpavVdiL9b96PdxUdbxwx2.jpg\", \"company_profile_file\": \"hf_agile_dvice/company_profile_file/kIfTy4g1wmN0cxBVXlNv6UcMORT4uTSNVb3ApaBs.pdf\"}', 1, '2025-07-01 13:02:14'),
(430, 658, 'ECALBIO Co.,Ltd', 17, '91420100581823979B', NULL, '581823979B', 'HZAU, Luoshi Road, Wuhan City 430075, China', 'Wuhan', 'Hubei', '430000', 'China', '18963964485', NULL, NULL, 'http://www.ecalbio.com', 'kuton', 'info@ecalbio.com', '86-27-87745856', 'Manager', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 30, 'AED', NULL, 7, NULL, NULL, '[\"Aflatoxin MIX Standard (B1,B2,G1,G2), Aflatoxin B1 Standard , Aflatoxin B1 Immunoaffinity Column, Aflatoxins (B1/B2/G1/G2/M1/M2) Immunoaffinity Column,  Kato Katz Test Kit\"]', '[]', 'Ecalbio Co.; Ltd  specialize in developing reagents of immunassay technology and biological systems with higher accuracy and reliability for results of the highest quality.Ecalbio builds up professional platform to develop more than 10,000 products, including antibodies, antigens, biochemicals, ELISA kits, CLIA kits, and laboratory equipments,etc.', 1980, NULL, 5.00, 0, 100.00, 5.00, NULL, 'pending_approval', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-07-05 06:16:37', '2025-07-05 06:36:26', '{\"trade_license_file\": \"ecalbio_coltd/trade_license_file/DvZDgv6SKvmcx2WeLS4v96T5Y3t2g9tn4z0yE3Y3.jpg\", \"certification_files\": [\"ecalbio_coltd/certifications/XDrX3RQuS750nhZcfJmH4hlM2IrpsVPYwX1iuyJb.jpg\"], \"company_profile_file\": \"ecalbio_coltd/company_profile_file/ajiXMfGQMl4IJ3ru22GPvakUKKU9uUBf82BEp9bj.pdf\", \"tax_certificate_file\": \"ecalbio_coltd/tax_certificate_file/yD22MlHvMA0UzZAPeGPmQMArrm4TbwA0v4SUaSzs.jpg\"}', 1, '2025-07-05 06:36:26'),
